(857, '2016-01-01', 1605, 'PC', 'Descarga', 'VOSE', 'Película bastante curiosa e intrigante. Demuestra que con una buena idea, no hace falta tener presupuesto. La fotografía es bastante pésima, los actores regulares y la banda sonora bastante normal, tan solo la idea principal del guión bastará para mantener los 80 minutos que dura la cinta pegado a la pantalla.', 7, 7.6, 8, NULL, 8.5, 7.4),
(858, '2016-01-02', 701, 'TV', 'Netflix', 'Castellano', 'Bastante rabia da el poner un 3 a esta película, capaz de reunir a personajes tan emblemáticos como Dorian Gray, Ishmael, Mina, el hombre invisible, Moriarty, Nemo, Sawyer… El principal problema son sus efectos especiales y las frases cliché de película de acción. Los personajes están mal definidos, presentados bruscamente e intentan darse a conocer contando una historia ya sabida. Pudo ser una gran película.', 3, 4.9, 5.8, 1.7, 4.4, 4.6),
(859, '2016-01-03', 1465, 'PC', 'Descarga', 'VOSE', 'Y es que sólo basta una idea poderosa. Me repito, sí, pero es una máxima del cine. Con apenas efectos especiales crea un terror sobrenatural que mantendrá pegado al asiento a cualquiera que la vea. Una joya del cine independiente de terror. De las mejores del año.', 9, 6.3, 6.9, 9.6, 6.5, 7.4),
(860, '2016-01-03', 727, 'PC', 'Descarga', 'VOSE', 'Una dirección sucia e imperfecta que no llega a eclipsar el rotundo guión, adaptado de un manga. Película que lleva la venganza al extremo, parecida en muchos aspectos a Kill Bill. Magnífico final.', 8, 7.9, 8.4, 8, 9.4, 8.4),
(861, '2016-01-04', 1518, 'TV', 'Descarga', 'VOSE', 'Siguiendo el estilo de Lanthimos, The Lobster no dejará indiferente al que la vea. Su idea, al igual que Canino, es brillante a la par que absurda.  Peca del excentricismo característico de Yorgos, y por ello se hace larga a la mitad, aunque el tono humorístico que envuelve toda la película hace que sea menos pesada.', 7, 7, 7.4, 9.1, NULL, 7.6),
(862, '2016-01-04', 1519, 'TV', 'Descarga', 'Castellano', 'Idea similiar a la de Sneaky Pete. Me gusta cuando una película me engaña y me hace quedar en ridículo como espectador, no confundir con lo que pretende hacer Amenábar en Regresión, a eso se le llama tomadura de pelo. En esta película Shyamalan empieza de cero tras sus dos esperpénticos fracasos, y va retomando lo que en principio fue, logrando una película de esas que el primer visionado es el mejor. Quizás el género del found footage se vaya quedando obsoleto y haya que buscar nuevas formas, en este caso, eliminando todo elemento sobrenatural. En definitiva, una cinta bastante decente, que es mucho, comparado con lo que estaba haciendo.', 7, 5.9, 6.3, 6.4, 5.5, 6),
(863, '2016-01-05', 1266, 'TV', 'Descarga', 'VOSE', 'Buena pareja de actores pero con un guión bastante simple y soso. Sesiones en las que un discapacitado tendrá sexo por primera vez. La idea se ve venir desde el primer contacto entre los dos. Lo mejor es la interpretación de William H. Macy.', 5, 6.8, 7.2, 9.3, 8, 7),
(864, '2016-01-05', 1593, 'TV', 'Netflix', 'VOSE', 'Documental que trata, o al menos lo intenta, la manipulación de los medios hacia Corea del Norte. Tiene tanta ambigüedad que ni el mismo director sabe qué ha acabado haciendo. Aún así aclara muchas facetas acerca de la vida de los norcoreanos, y sobre su cerrada cultura.', 6, 6.5, 6.8, NULL, NULL, 6.6),
(865, '2016-01-05', 624, 'TV', 'YOMVI', 'VOSE', 'Simple y tonta. Parece que la película entera está hecha para la escena final de Christian Bale protagonizando el nuevo GTA. Al final, todo estaba en su cabeza y es que está enfermo. Pues ahórrense la hora y media de metraje.', 6, 6.5, 7.6, 6.7, 8.5, 7.6),
(866, '2016-01-06', 217, 'TV', 'Blu-Ray', 'VOSE', 'Musical picaresco, incitante y gamberro. Contiene diálogos y situaciones de serie B, referencias a los clásicos del género, una de las mejores introducciones de la historia, un genial Tim Curry que hará uno de esos papeles inolvidables de la historia del cine... Y todo ello en 100 minutos, repletos de lujuria, desenfreno, burla (incluso a Dios, en forma de Frank N+ Furter) y provocación.', 10, 7, 7.4, 8, 8.5, 7.4),
(867, '2016-01-07', 1520, 'TV', 'Netflix', 'VOSE', 'Demasiado aburrida. No sabría hacer un resumen porque creo que ni el mismo guionista sabe lo que ha escrito. Trata sobre Bradley Cooper yendo de un lugar a otro y no sé qué de misiles, satélites y espiritismo hawaiano. La peor película del año, y estaba difícil superar a El destino de Júpiter y Tomorrowland.', 1, 4.3, 5.5, 2, 2.9, 4.2),
(868, '2016-01-07', 117, 'TV', 'Blu-Ray', 'Castellano', 'Impecable guión, impecable dirección y en general una película perfecta, de un maestro como es Hitchcock. No hay nada que destaque del resto, todo es magistral como digo, si acaso la actuación de James Stewart, en su tónica habitual. El giro de guión del final te hará sentir ridículo. Aprende a hacer giros de guiones, Amenábar.', 9, 8.3, 8.4, 9.7, 9.3, 8.6),
(869, '2016-01-08', 1173, 'PC', 'Netflix', 'VOSE', 'Contiene divertidas escenas basadas en el humor ridículo, en los malentendidos y los líos amorosos. Está bien para verla con tu novia pero nada más allá, Destacar sobre todo la actuación de Steve Carell y Emma Stone.', 6, 6.4, 7.4, 7.8, 7.7, 6.8),
(870, '2016-01-09', 1095, 'PC', 'Netflix', 'VOSE', 'En EEUU el tema de la virginidad es algo muy importante y si mientes sobre ello puedes desencadenar cosas muy malas, es lo que viene a decir esta película, tan mala como guapa es Emma Stone. Típica cinta que alquilan un grupo de jóvenes para pasar la tarde. Tras Aloha y ésta, sigo queriendo ver películas de Emma Stone, eso sí que es amor. Me soprtende que tenga una nota tan alta en las diversas páginas, la película no vale para nada.', 2, 5.7, 7.1, 8.5, 7.7, 6.8),
(871, '2016-01-09', 512, 'PC', 'Descarga', 'VOSE', 'Ópera prima del director de Drive y de Mads Mikkelsen. No presté mucha atención, así que esta crítica no va a tener mucha validez. Parecía una película más sobre el narcotráfico, con buenas escenas de persecución y poco más. Me arrepiento de haber visto a mi querido Mads así. A Nicolas le quedaba mucho por aprender hasta llegar a Drive.', 6, 6.5, 7.4, 8.1, 8.6, 7.2),
(872, '2016-01-10', 1251, 'PC', 'Netflix', 'VOSE', 'Toda un poema visual y artístico. Quizás no tenga el mejor de las ideas y si quitamos todo el estilismo la película no dure más que un mediometraje, pero es una cinta memorable de las que merece la pena revisar. La fotografía está muy saturada, la música es perfecta y la película es un delirio constante de fiesta, sexo y drogas. Tiene tres escenas perfectas: La del atraco, la del baile en la canción de Britney Spears y la del tiroteo final. La película más infravalorada de los últimos años.', 8, 4.9, 5.3, 6.6, 3.8, 6.4),
(873, '2016-01-10', 240, 'PC', 'Descarga', 'VOSE', 'Frívola y burlona. Toda una joya de la sátira que fue censurada en su estreno debido a su contenido paródico. Obviamente, esto le dio publicidad. ', 8, 7.9, 8.1, 9.6, 9.3, 8),
(874, '2016-01-11', 1035, 'PC', 'Netflix', 'VOSE', 'Me dejó un poco indiferente en cuanto la vi, pero pensándola bien y pensando sus escenas es una película muy memorable. Me refiero a escenas como la de cuando lanzan piñas o cuando los sacan de los túneles con sidra. Además que la banda sonora (de Alexandre Desplat, maestro) acompaña muy bien dichas escenas. Sigue fiel a su estilo Anderson, y la verdad es que se agradece ver una película tan bien cuidada.', 7, 7.3, 7.8, 9.2, 8.4, 8),
(875, '2016-01-12', 1267, 'PC', 'Descarga', 'VOSE', 'Soy inexperto en muchas cosas. Una de ellas es el cine surrealista o experimental. Y lo reconozco, no la he entendido, he pasado toda la película tratando de buscarle explicación a todos los sucesos, pero es imposible, quizás pasen sin más y ya está. De todos modos, esto no puede servir de pretexto para que sea una buena película, creo que no lo es. Es una sucesión de ideas que al guionista se le pasan por la cabeza y va escribiendo, pero no por ser surrealistas son mejores o algo así. Eso sí, como recomendación para cualquiera que quiera pasar un rato y quedarse rallado sirve.', 6, 6.3, 7.1, 9.1, 7.1, 7.6),
(876, '2016-01-13', 842, 'PC', 'Netflix', 'VOSE', 'Un truco de magia que te hará sentir engañado al desvelar su tremendo giro de guión. Pierde cuando la ves por segunda vez pero aún así conserva el encanto mágico que le caracteriza. Es de esas que luego estás horas e incluso días dándole vueltas. Genial la aparición de David Bowie, la fotografía y la rivalidad a la que puede llegar el ser humano, como recurrir a lo paranormal cuando la respuesta era demasiado sencilla, pero estoy seguro que ni a un solo espectador se le hubiera ocurrido.', 9, 7.4, 8.5, 7.6, 9.2, 8),
(877, '2016-01-15', 1589, 'PC', 'Descarga', 'VOSE', 'Tremendo documental que revela las atrocidades que se cometieron en Indonesia contra los comunistas en la década de los 60. Visto a través de Adi, una mirada inocente y curiosa por saber qué le paso a su hermano Ramli. La tremenda frialdad con el que los asesinos relatan los hechos pone los pelos de punta y hará estremecer a más de uno.', 8, 7.9, 8.4, 9.6, 9.4, 8.6),
(878, '2016-01-16', 238, 'TV', 'Descarga', 'Castellano', 'Curiosa ópera prima de Sylvester Stallone, con un guión muy pobre y sin nada destacable salvo un buen uso, aunque excesivo de la cámara lenta. Algunos planos están bien cuidados y tiene algún golpe de humor bueno. La canción de la secuencia de créditos iniciales (la mejor de la película, junto a la pelea final) está cantada por el propio Sylvester Stallone.', 6, 5.7, 5.8, NULL, 4.4, 6),
(879, '2016-01-17', 1521, 'TV', 'Descarga', 'Castellano', 'Típica película mala de acción moderna con las frases clichés que interrumpen las escenas de acción para que quede todo más guay. Rupert Friend (quizás por el cariño que le tengo por Homeland) tiene muchísimo carisma y es lo único que se salva de la película. Ni siquiera la idea es original.', 3, 4.5, 5.8, 0.8, 4.3, 4.2),
(880, '2016-01-18', 1522, 'PC', 'Netflix', 'VOSE', 'Ojalá Adam Sandler se retirara del mundo de la actuación o del mundo en general. Qué asco de tío. La película no tiene nada de gracia, es tosca, bruta y con chistes de pedos y de caca característicos del señor Sandler. Schneider y Wilson lo único salvable de la peli. Ojalá olvidarla pronto y no acordarme de que me ha hecho perder 2 horas en plena carrera hacia los Oscar.', 1, 3.6, 4.9, NULL, NULL, 3.4),
(881, '2016-01-20', 1523, 'Cine', 'Salamanca', 'Castellano', 'Vista desde el punto de vista subjetivo y agónico de Saul, un sonderkommando que cuando cumpla su trabajo en el campo de concentración será ejecutado como el resto. El principal detalle de esta película es la steadycam que acompaña en todo momento a Saul y pocas veces deja ver el segundo plano, casi siempre desenfocado. La escena inicial es brutal por su crudeza, al igual que un par de escenas más, pero la película en general peca de vacía, pues el mensaje que intenta dar es demasiado plano. ', 7, 7.2, 7.9, 9.3, 8.7, 8),
(882, '2016-01-21', 1524, 'PC', 'Descarga', 'VOSE', 'Película hecha para que Jennifer Lawrence gane su segundo Oscar, porque no vale para nada más. Pensé que iba a estar en su nivel de sobreactuación, pero está bien medida y domina bastante bien el papel, que a priori no suponía demasiados riesgos. Robert, llama a Scorsese y haced algo porque estás empezando a preocupar.', 4, 5.7, 6.7, 6, 5.8, 6),
(883, '2016-01-22', 1525, 'PC', 'Descarga', 'VOSE', 'Historia de la venganza llevada al extremo en las profundidades de América. Iñárritu sigue su estilo que perdió en Birdman: el plano sucio, movido y rápido, que, acompañado de la fotografía de Lubezki (el mejor fotográfo del mundo actualmente) hacen escenas acompañando el poder de la narrativa. De Leo qué decir, es de los mejores actores del momento y no le hacen falta premios para saber eso. Antes de verla tenía bastante seguro que iba a ganar el Óscar pero no tengo muy claro que sea del gusto de la academia y que no opten por Mad Max o en menor medida por Spotlight. Ganará Lubezki seguro.', 8, 7.6, 8.3, 8.2, 8.6, 7.8),
(884, '2016-01-23', 1526, 'TV', 'Descarga', 'Castellano', 'Patriótica y ligeramente manipuladora, pero no quita que sea una buena película, aunque la mayor parte la hace el hecho real. No es de lo mejor de Spielberg ni de lo mejor del año y pronto se olvidará.', 7, 7, 7.7, 9.1, 8.9, 7.4),
(885, '2016-01-24', 1527, 'TV', 'Descarga', 'VO', 'Comedia demasiado trosca como para hacer gracia. Al principio tiene algunos momentos buenos pero el guión es una auténtica memez que no la firma ni Adam Sandler. Destacar la actuación de Mario Casas y poco más.', 3, 5.4, 5.9, NULL, NULL, 5.8),
(886, '2016-01-26', 1528, 'PC', 'Descarga', 'VOSE', 'Puede que peque de cursi y fácil, incluso que es muy previsible todo el desarrollo de la trama, pero la verdad es que es una película que conmueve. Desde el primer momento que Redmayne aparece en pantalla empatiza con el espectador y lo cautiva cuando se convierte en Lili. Y quizás me deje llevar por el afecto que le tengo a este tipo de historias y la rabia que me da y la impotencia que siento al saber que hubo personas que sufrieron así.', 7, 6.8, 6.8, 7, 7.4, 6),
(887, '2016-01-27', 1529, 'PC', 'Descarga', 'VOSE', 'La película se hace por sí sola por la historia que cuenta. Todo el film está bien acompañado por la banda sonora y las tremenda actuaciones de Ruffalo y Keaton. Es increíble que la Iglesia siga impune tras estos incidentes. Dejará boquiabierto en los créditos, cuando salen todos los lugares donde se han cometido abusos. Asqueroso a la par que tremendo.', 8, 7.4, 8.3, 9.6, 9.5, 8.2),
(888, '2016-01-28', 181, 'Cine', 'Madrid', 'VOSE', 'Vista en la filmoteca de Madrid. Lo original de la cinta es su narrativa, contada en dos líneas temporales distintas. Las actuaciones son demasiado planas y el final deja un poco frío.', 5, 7.2, 7.7, 10, NULL, 7.6),
(889, '2016-01-28', 132, 'Móvil', 'Descarga', 'VOSE', 'Me inicio en la Nouvelle vague con esta película con una experiencia bastante positiva. El protagonista es el típico machista que se cree que las mujeres están para complacer a los hombres. La mujer (Jean Seberg, tremenda) es la que le conducirá a su perdición.', 9, 7.7, 8, 9.7, 9, 8),
(890, '2016-01-29', 155, 'TV', 'Descarga', 'VOSE', 'Segunda película de Godard y la mujer es del mismo tipo que À bout de souffle. ', 7, 7.5, 7.7, 9.4, 8.5, 8),
(891, '2016-01-29', 1530, 'TV', 'Descarga', 'Castellano', 'Aburrida, sosa, insulsa. Nada se salva, si acaso la curiosa historia para situar al personaje. Totalmente innecesaria. De las peores del año. Pérdida total de tiempo.', 1, 5.2, 5.9, 2.6, 4.4, 4.6),
(892, '2016-01-30', 147, 'TV', 'Descarga', 'VOSE', 'Una nueva forma de hacer una película. Empieza con un diálogo de espaldas a la cámara. Las 12 escenas no tienen mucho sentido entre ellas y parecen simplemente cortos. Anna Karina clava su papel de mujer perdida en la vida y la conversación del final enseña más que cualquier clase de filosofía. Toda una lección de cine.', 8, 7.8, 8.1, 9.3, 9.2, 8.2),
(893, '2016-01-30', 1594, 'TV', 'Netflix', 'VOSE', 'Crudeza y dureza a partes iguales en este documental que parece filmado por chavales en la guerra de Maidán. Este documental pone de manifiesto la brutalidad policial que hostigó a los jóvenes manifestantes ucranianos. Al final parece que se resuelve el conflicto, pero esos 1000 muertos no es sólo una cifra, son 1000 vidas perdidas.', 8, 7, 8.5, 9.5, 9.4, 7.8),
(894, '2016-01-30', 816, 'TV', 'Blu-Ray', 'Castellano', 'Se hace un poco aburrida por su longitud, aunque es necesaria para explicar todo lo que influyó en la vida de Johnny Cash, empezando por su hermano. Phoenix clava la voz (dudo que no sea playback)  de Cash y Reese aporta frescura y alegría con su actuación. Destacar también la aparición de otros personajes como Elvis Presley, Jerry Lee Lewis o Buddy Holly.', 6, 7, 7.9, 8.2, 9, 7.4),
(895, '2016-01-31', 159, 'TV', 'DVD', 'VOSE', 'Inspiración de Tarantino y de tantos otros. La frescura de su trío protagosnita hacen de estos 30 minutos una auténtica delicia visual a manos del que se ha convertido por la fuerza en uno de mis directores favoritos. Jean-Luc me enseña a amar el cine, a hacer de ello un arte, a querer vivir la vida de los protagonistas.', 7, 7.4, 7.9, 9.5, 9.1, 7.8),
(896, '2016-01-31', 1466, 'TV', 'Descarga', 'Castellano', 'Poco que decir… La historia es un poco simple y está bien llevada, aunque la relación entre los personajes está muy forzada y mal explicada, lo que la hace un poco superficial y falsa.', 6, 6.7, 7.4, 8.1, 7.8, 7),
(897, '2016-02-01', 1531, 'PC', 'Descarga', 'VOSE', 'Larga en ocasiones y humorística en otras, ese humor es lo que da el aprobado a esta película española aunque no lo parezca, por suerte. Destacar la actuación de Benicio en su línea habitual y el genial Tim Robbins. Que esté nominada al Goya a mejor película quiere decir lo mal que está este país en cuanto a calidad cinematográfica. Los mejores momentos son cuando suena Sweet Dreams de Marilyn Manson y Venus in Furs de The Velvet Underground.', 6, 6.7, 6.9, 6.6, 4.5, 6.6),
(898, '2016-02-02', 10, 'PC', 'Descarga', 'VOSE', 'Toda una joya que hace amar el cine. Una historia de amor y desamor, de rabia y pasión. Una canción a dos humanos. No es casualidad que la mujer de la ciudad vista de negro y la esposa de blanco. No es casualidad que la mujer de la ciudad esté en la rama de un árbol esperando, ansiosa, a su objetivo. Quizás se le pueda poner la pega de la escena del circo, característica de las películas cómicas de la época y que desentona con el tono melodramático del resto de la cinta, pero se ve como el lazo está fuertemente unido entre la magnética pareja de protagonistas. Por todo eso, por las transparencias, por Janet Gaynor y por el amor dramático, esta es una delicia del séptimo arte, una de esas que no se olvidan jamás.', 10, 8.5, 8.4, 9.8, 9.2, 8.6),
(899, '2016-02-03', 1532, 'Cine', 'Salamanca', 'Castellano', 'Sorrentino consigue transmitir poesía visual, en parte gracias a los geniales Michael Caine y Harvey Keitel. Una de las must-sees del año, sus momentos de surrealismo son absolutamente geniales, una joya del 2015.', 9, 7.2, 7.4, 7.2, 7.2, 7.2),
(900, '2016-02-04', 1533, 'PC', 'Descarga', 'VOSE', 'El director cuenta la dureza con la que son reprimidas las mujeres en Oriente de manera tan cruda y directa que llega directamente al espectador. Las 5 actrices son buenísimas y la banda sonora acompaña muy bien. La escena final está sobrecargada de gran tensión. Quedará fuera de los premios debido a que la temática de Saul Fia es sobre la segunda guerra mundial.', 7, 7.4, 7.6, 9.6, 9, 7.8),
(901, '2016-02-05', 1268, 'PC', 'Netflix', 'VOSE', 'La mejor película mumblecore (y mi iniciación en este género) según Filmaffinity. Y poco que decir, parece como si un joven Godard quisiera innovar, pero la película es bastante sencilla y simple, salvo la genial Greta Gerwig, la cual no pierde la sonrisa ante ninguna situación. Quizás en unos años se estudie esta película como todo un referente de esta corriente.', 6, 6.9, 7.4, 9.3, 7.7, 7.6),
(902, '2016-02-08', 344, 'PC', 'Descarga', 'VOSE', 'Las canciones de David Bowie es lo único salvable de esta película tan mediocre y tosca que se hace aburrida. Se nota la mano de George Lucas en la cutrez de las animaciones. No sé cómo pudo tener tanto éxito.', 3, 7.3, 7.4, 6.6, 8.6, 7.2),
(903, '2016-02-09', 168, 'PC', 'Descarga', 'VOSE', 'Mouchette es una adolescente marginal que tiene que buscarse la vida por sus propios métodos. Se parece a la anterior que vi de Bresson y no sé qué más decir porque la vi hace una semana.', 7, 7.8, 7.8, 8.7, 8.7, 8),
(904, '2016-02-11', 1534, 'PC', 'Descarga', 'VO', 'Sorprende la rapidez con la que esta película toma el pulso, enganchando al espectador los 93 minutos de la cinta. Es un soplo de aire nuevo al cine español. Habrá que seguirle la pista al del videoclub de Aquí no hay quien viva.', 7, 6.4, 6.5, NULL, NULL, 6.4),
(905, '2016-02-12', 776, 'PC', 'Descarga', 'VOSE', 'La peor película de Wes Anderson que he visto. Aburrida, larga, tediosa, fuera de sitio. Hace odiar a Bill Murray. Lo único salvable es Seu Jorge interpretando algunas canciones de Bowie. Bendito seas, David.', 3, 6.6, 7.3, 5.6, 8.2, 7.4),
(906, '2016-02-13', 870, 'PC', 'Descarga', 'Castellano', 'Simple, sosa, fácil, los personajes son totalmente planos, llega a hacer que no te importe en lo más absoluto lo que les pase.', 2, 5.9, 6.7, 7.5, 6.5, 6.2),
(907, '2016-02-14', 646, 'PC', 'Descarga', 'VOSE', 'Rozando el adamsandlerismo pero con toques de humor, que ya es mucho. Me he llevado una grata sorpresa con esta película, y es que pensaba que era una comedia ridícula más, y lo es, pero tiene esos momentos, como cuando están en el piso de Hansel, que hace quererla en cierta manera. Su crítica al mundo de la moda, enmascarada con todo el ridículo es sublime. Pero tan poco nos pasemos y nos dejemos llevar, que la película es lo que es.', 5, 5.4, 6.6, 6.4, 8, 6.6),
(908, '2016-02-15', 1371, 'PC', 'Descarga', 'VOSE', 'Señor Joseph: Has trabajado con Nolan, ¿no se te podría haber pegado algo de su talento? Venga, que eso del porno está muy visto, que vienes como revelador de que a todos los hombres nos gusta el porno, ay… Eso sí, eternamente agradecido por la escena de Scarlett Johansson en la que estabáis completamente vestidos. Además, un poco más de porno no hubiera venido mal. Esa calificación NC-17...', 4, 5.7, 6.6, 8, 5.8, 6.2),
(909, '2016-02-16', 1535, 'PC', 'Online', 'VOSE', 'No explora nada el género como sí lo hizo en su momento La vida de Adèle. Es innevitable compararla con la cinta de Abdellatif Kechiche, pues esta parece una versión de los chinos. La relación entre los personajes se muestra forzosa, intenta contar todo en 100 minutos cuando el problema puede que pase por las actrices, o al menos por Izïa.', 5, 6.9, 6.6, NULL, NULL, 6.6),
(910, '2016-02-18', 1467, 'PC', 'Descarga', 'VOSE', 'Como he leído ahora, siguiendo en la línea de Sergio Leone, Kristian Levring se marca un western bastante épico. Muestra dotes de buen director en varias de las escenas y qué decir de Mads Mikkelsen, de los mejores actores en la actualidad. Muy grata sorpresa me he llevado al ver esta película que no esperaba que fuera tan buena. Pero es un must-see del pasado año.', 8, 6.5, 6.8, 7, 6, 6.4),
(911, '2016-02-19', 1536, 'PC', 'Descarga', 'VOSE', 'Lo destacable de la película es lo obvio, que ni siquiera voy a remarcar, puesto que no innova nada en el género. Laia Costa quizá esté exagerada. Está muy bien dirigida y tiene momentos de tensión muy agudos.', 7, 6.8, 7.8, 8.1, 8.4, 7.6),
(912, '2016-02-20', 1537, 'TV', 'Online', 'VOSE', 'Cómo una ola de calor afecta al retrasado del pueblo y comete fechorías, se podría haber titulado esta peli, carece de impulso narrativo, la presentación de los personajes parece forzosa, pues en la siguiente escena desarrollarán una de las características introducidas anteriormente. La historia es buena, y eso salva a la película, dado que las emociones del protagonista hacen empatizar al espectador, ya que no es más que un tonto lleno de bondad, aunque la demuestre con pesadez.', 6, 6.3, 6.1, NULL, NULL, NULL),
(913, '2016-02-20', 1538, 'TV', 'Descarga', 'Castellano', 'Sí, la dirección artística es muy buena, vestuario bien cuidado, ambientación lograda… pero no deja de ser otra película moderna de terror con sustos gratuitos, abominaciones digitalizadas y casas encantadas, aunque siempre es un placer disfrutar de una buena actuación de Jessica Chastain.', 5, 6, 6.7, 6.9, 5.8, 6.8),
(914, '2016-02-21', 269, 'TV', 'Blu-Ray', 'VO', 'Curiosa aventura prehistórica sobre mantener el  fuego… poco que decir de la película… Buena fotografía y debido al paso del tiempo el maquillaje canta un poco, pero es bastante entretenida.', 7, 7.2, 7.4, 8.3, 7.5, 6.8),
(915, '2016-02-22', 393, 'PC', 'Descarga', 'VOSE', 'Todo un clásico de la comedia, con la mítica escena del orgasmo, etc. Etc. Pero a mí me da la sensación de cuando lleva 1 hora todavía no ha pasado gran cosa, y al final de la cinta tampoco. Aún así son 93 minutos muy divertidos y entretenidos, acompañados de los geniales Meg Ryan y Billy Crystal.', 7, 7, 7.6, 8.9, 8.9, 7.8),
(916, '2016-02-23', 1468, 'PC', 'Descarga', 'VOSE', 'Se le nota el artificio desde el primer momento, se le nota también el ahorro de dinero al focalizar la acción de la trama en un sótano, las intenciones en la escena final… Aún así esta escena roza la maestría y hace que toda la película haya merecido la pena. Muy digna.', 6, 6.4, 7.3, 9.8, 8.2, 7.6),
(917, '2016-02-24', 1539, 'Cine', 'Salamanca', 'Castellano', 'Qué pesadez de película, Dios mío… Que sí, que Blanchett y Mara son buenísimas actrices, pero qué más tiene la peli, absolutamente nada. He sentido que he perdido el tiempo viendo esta pieza que espero olvidar pronto.', 3, 7.2, 7.4, 9.3, 7.6, 8),
(918, '2016-02-25', 1532, 'PC', 'Descarga', 'VOSE', 'Sorrentino consigue transmitir poesía visual, en parte gracias a los geniales Michael Caine y Harvey Keitel. Una de las must-sees del año, sus momentos de surrealismo son absolutamente geniales, una joya del 2015.', 10, 7.2, 7.4, 7.2, 7.1, 7.2),
(919, '2016-02-26', 1595, 'PC', 'Descarga', 'VOSE', 'No logro comprender el objetivo de este documental, quizás sea demasiado joven para comprenderlo. Si el objetivo era captar la sociedad iraní ¿por qué hacer un falso documental? De verdad, no lo entiendo.', 5, 6.8, 7.5, 9.6, 8.2, 7.6),
(920, '2016-02-27', 182, 'TV', 'Blu-Ray', 'Castellano', 'Araña la superficie de lo que podría haber sido una obra maestra. La tildan de anticomunista, y siendo yo como soy, no le he visto nada de este estilo salvo 1 o 2 detalles, nada especiales para quien esté acostumbrado a las películas americanas. Es una película normal de Hitchcock, sí, pero eso es muy superior a lo que el resto de películas normales se considera.', 6, 6.4, 6.3, 6.4, 3.6, 5.6),
(921, '2016-02-28', 1566, 'TV', 'Descarga', 'Castellano', 'Chorrada de artes marciales y chinos volando y vestuarios y escenarios molones. La película es lenta y parada, las escenas de acción rápidas a la vez que se detienen a observar cómo cae una gota de agua o nimiedades del estilo, la historia de amor es innecesaria, pero parece un elemento necesario para que todo el guión se desarrolle, que no Netflix, no convences, más Beasts of no Nation y menos The Ridiculous 6.', 2, 5.2, 6.5, 1.5, 5, 5.6),
(922, '2016-02-29', 1540, 'PC', 'Descarga', 'VOSE', 'Una excusa para grabar porno en 3D. Como si nunca antes se hubiera hecho. Los personajes son planos y el guión demasiado fácil. Aún así es una buena experiencia (¿ver una corrida en primer plano?) y no será fácilmente olvidada.', 6, 6.1, 6, 4.1, 3.7, 5.8),
(923, '2016-03-01', 1269, 'PC', 'Descarga', 'VOSE', 'Originalidad es como definiría a esta película, de esas que el guión toma el control de la película y hace del espectador lo que le apetezca. Zoe Kazan demuestra talento, talento que no le falta a Paul Dano en ninguna de sus interpretaciones. Todo recubierto de una simpática historia de amor. Grata sorpresa.', 7, 6.8, 7.2, 7.9, 7.5, 6.8),
(924, '2016-03-02', 422, 'PC', 'Descarga', 'VOSE', 'Película feminista por excelencia. Quizás se haga larga y a la mitad de la película te preguntes de qué va esto, pero el mensaje que transmite, y en especial para la época es renovador y fresco. La persecución y el plano final son icónicos, y es lo que cambia del 7 al 6 en esta película.', 7, 7.1, 7.4, 8.3, 8.2, 7.4),
(925, '2016-03-03', 728, 'PC', 'Descarga', 'VOSE', 'Asombrosa. De esas películas que no deja indiferente a nadie. Sus diálogos son excepcionales, a la altura de sus actuaciones. El guión no contiene escenas sobrantes e incómodas. En cuanto a la banda sonora, posiblemente estemos ante uno de los mejores compositores del siglo. Y qué decir del croma para grabar exteriores porque grabar en una azotea se salía del presupuesto. Es obligatorio ver esta película con alguien más para ir comentando lo que pasa, si no os odiaréis de por vida.', 1, 3, 3.5, 3.5, 4.6, 5.6),
(926, '2016-03-04', 599, 'PC', 'Descarga', 'VOSE', 'Destaca por su sencillez según dice la crítica, pero a mí lo que más me ha gustado (después de la actuación de Richard Farnsworth) es la banda sonora, compuesta por Angelo Badalamenti, de las mejores que han podido escuchar mis oídos. La película es toda una experiencia que dudo que deje espectador sin conmover. Eso sí, poco rasgo de  Lynch se puede apreciar.', 8, 7.8, 8, 9.6, 9.1, 8),
(927, '2016-03-05', 1541, 'TV', 'Descarga', 'Castellano', 'Ha sido molida por la crítica y no voy a defender a esta película pero no es tan tan tan tan tan tan mala. Estamos en el año en que se han visto "joyas" como La mujer de negro 2, Ouija, Area 51, etc. En las cuales no sólo no se aporta nada al género, si no que las escenas de terror parecen de comedia. Aquí tenemos el snuff, que ya vimos en la primera, que, acompañada de una buena banda sonora hace que las escenas no sean tan tediosas. En resumen, no es ni de lejos una buena película, ni aporta nada al género, pero no es tan mala como cabe esperar.', 5, 4.3, 5.3, 1.3, 3.2, 4.4),
(928, '2016-03-06', 97, 'TV', 'Netflix', 'VOSE', 'Según dicen, la forma de redimirse de Elia Kazan ante la famosa caza de brujas, pero si nos centramos en la película, tenemos a posiblemente la mejor actuación de la historia del cine: Marlon Brando haciendo de un joven con actitud canallesca. La fotografía sitúa a la perfección en el ambiente barriobajero del puerto. Y poco más que decir, que ya se ha dicho todo, una grandiosa película.', 9, 8.1, 8.3, 9.8, 9.5, 8.4);
INSERT INTO `fechastitulos` (`id_visionado`, `fecha`, `id_titulo`, `medio`, `formato`, `audio`, `comentario`, `puntuacion`, `filmaffinity`, `imdb`, `tomatometer`, `audiencescore`, `letterboxd`) VALUES
(929, '2016-03-06', 1579, 'TV', 'Blu-Ray', 'VO', 'Toda una extraña familia que cuenta sus vivencias y se lanzan pullas los unos a los otros, acompañada con una alta dosis de locura, sólo comparable a su gafapastismo, quien dice gafapastismo dice cultura. Pero conoció a Michi Panero.', 7, 7.9, 8.3, NULL, 10, 7.6),
(930, '2016-03-07', 1174, 'PC', 'Netflix', 'VOSE', 'Típica comedia mala americana con juegos de palabras y tópicos americanos. Emma Stone sale 2 segundos y Mila Kunis mucho pan pero al final poco chorizo. Destacable (¡tiene algo destacable!?) la aparición de Richard Jenkins.', 2, 5.5, 6.6, 7, 6.5, 5.8),
(931, '2016-03-08', 540, 'PC', 'Descarga', 'VOSE', 'Cine experimental puro y duro. Y malo. Estoy a favor de todo tipo de cine pero esto es una puta mierda, no tiene guión salvo 1 o 2 historias (no pasa nada), la fotografía y la banda sonora son horribles. Entonces qué queda. Pues una mierda de película hecha por un joven director para hacerse el guay.', 2, 6.6, 6.6, 3.3, 7.3, 7),
(932, '2016-03-10', 600, 'PC', 'Descarga', 'VOSE', 'Kubrick, te quiero mucho pero podrías haber hecho una película bastante memorable como legado. He subido demasiado puntuando un 7, pues originalmente le puse un 6, pero recordé la escena de la secta, lo bien acompañada que estaba de vestuario y banda sonora, todo el misticismo que rodea esos mundos y toda la intriga que mantiene durante toda la película que es irresistible no puntuarle más. Se ven muchos desnudos.', 7, 6.8, 7.3, 7.4, 7.3, 7.8),
(933, '2016-03-11', 1513, 'TV', 'Descarga', 'Castellano', 'Villeneuve es de los mejores directores del año. En el revisionado de una de las mejores películas del pasado año lo confirmo. El manejo de cámara que tiene sólo es comparable a cómo juega con la banda sonora, el despiste, la fotografía, la visión nocturna... La escena de la frontera, la del túnel, la de la cena final están dirigidas magistralmente. Y ni hablar de la actuación de Benicio, qué barbaridad de actor.', 8, 6.9, 7.7, 9.3, 8.5, 7.8),
(934, '2016-03-12', 1542, 'TV', 'Descarga', 'Castellano', 'Falla en la forma, en cómo contar esta manida historia, pero tenemos a un monstruo bastante bien logrado, aunque sólo salga 2 minutos, lo del hermano de Victor sobra totalmente, la escena del mono sobra totalmente… Me he excedido dándole un 5 pero no ha sido un mal rato.', 5, 4.7, 6, 2.6, 3.9, 5),
(935, '2016-03-13', 1580, 'TV', 'Blu-Ray', 'VO', 'Secuela de El desencanto, los Panero cuentan cómo han sido estos 20 años. Juan Luis es el más cabrón de todos, no tiene apego ninguno por su familia ni por sus seres queridos (porque no tiene de esto último), Michi es el más cabal, el único cuerdo, porque Juan Luis tiene una grandilocuencia tan grande como su calva, como dicen en el documental. Siguiendo con Michi, estando visiblemente enfermo, me gusta su forma de hablar y de expresarse, de forma realista, cruda y totalmente lúcida. En cambio, Leopoldo, enfermo de esquizofrenia y paranoia, delira con alta cohesión gramatical, herencia de la amplia cultura de la que dispuso. El plano final demuestra que son como fantasmas. Y como Leopoldo dice, si no fuera por El desencanto, esta familia hubiera quedado olvidada para siempre. Pero al menos tenemos estos dos estupendos documentales, en los cuales nos reiremos y sentiremos lástima a partes iguales.', 7, 6.8, 7.5, NULL, NULL, NULL),
(936, '2016-03-14', 1543, 'PC', 'Descarga', 'VO', 'A caballo entre la comedia y el drama, Truman se alza como una de las mejores películas españolas del año. Gran parte de la gracia de la película reside en el acento de Ricardo Darín, Cámara me parece sosísimo, pero el final… ay… qué final (snif).', 8, 7, 7.2, NULL, NULL, 7),
(937, '2016-03-15', 1372, 'PC', 'Descarga', 'VOSE', 'Extraña, bastante extraña. No puedo hacer una crítica como si la hubiera entendido porque no lo he hecho, pero me ha gustado. Me ha cautivado. La nota es algo totalmente simbólico, le podría puntuar un 3 y me hubiera quedado igual. Pero tiene algo… Algo que atrae... Quizás sea el cuerpo de Scarlett.', 7, 5.7, 6.3, 8.5, 5.5, 7.6),
(938, '2016-03-16', 1036, 'PC', 'Descarga', 'VOSE', 'Es tan porquería que no merece ni comentar nada, pero mi amor a Emma Stone me obliga a hacerlo, aunque salga horrible aposta. McConaughey puede ser el mejor actor en la actualidad y hacía estas cosas, madre mía. La película es una parodia de las ya malísimas "Los fantasmas de las navidades pasadas", así que poco iba a mejorar.', 1, 4.5, 5.7, 2.7, 4, 4.4),
(939, '2016-03-17', 729, 'PC', 'Netflix', 'VOSE', 'La sucia fotografía se carga parte de la ambientación, y el enfoque que le quieren dar a la protagonista, de es que la sociedad le ha fallado, porque si no sería normal no es nada creíble. La relación con su novia araña la superficie de lo que podría ser. Charlize Theron (irreconocible) está sobreactuada.', 5, 6.6, 7.3, 8.2, 8.1, 7),
(940, '2016-03-18', 465, 'PC', 'Descarga', 'VOSE', 'Cine Jim Carrey. Interpretaciones histéricas, sobreactuación, a lo que se le suma unos efectos especiales ridículos y escenas bochornosas. Pero qué guapa es Cameron Diaz.', 1, 6, 6.9, 7.7, 6.7, 6),
(941, '2016-03-19', 316, 'TV', 'Blu-Ray', 'Castellano', 'Contraposición de culturas en las que un hombre bastante atractivo se ve implicado. Sectas así retrasan el progreso en el mundo. En cuanto a la película, Peter Weir como siempre consigue hacerlo bien, destacar las actuaciones de la pareja protagonista y un jovencísimo Lukas Haas, extraño caso de niño actor que no ha acabado drogadicto.', 7, 6.9, 7.4, 9.2, 8, 7.2),
(942, '2016-03-20', 430, 'TV', 'Blu-Ray', 'Castellano', 'Me resulta muy complejo valorar esta película como se merece realmente. Normalmente, valoro fotografía, guión, banda sonora, actuaciones, dirección… Y hago una mezcla y pongo una nota. Como digo, aquí es complejo, pues en cuanto a fotografía, vestuario, maquillaje, banda sonora y dirección artística en general, la película es sobresaliente. La historia es muy buena, sí. ¿Entonces porqué un 7? Por los excesos. Porque las actuaciones están excedidas. Porque el castillo de Drácula parece Labyrinth. Porque los vampiros no vomitan sangre en la cara. Porque las novias de Drácula no andan al revés. Vale que no hay que buscar coherencia a esta historia, pero tiendo a ello. Y por ejemplo cuando Drácula está yendo en barco, de repente aparece en Londres y luego vuelve al barco. O que se deje atrapar cuando controla todos los elementos, como el tiempo y el clima. Esas cosas son las que hacen bajar hasta 2 puntos esta tremenda película.', 7, 7.6, 7.5, 7.9, 8, 6.8),
(943, '2016-03-21', 194, 'TV', 'Blu-Ray', 'Castellano', 'Uno de los mejores thrillers que he visto. Cómo va aumentando la tensión hasta llegar al culmen de la escena final es magistral. Quizás la presentación de los personajes sea un poco larga, pero necesaria. La sucesión de planos es buenísima. El sonido que hay de fondo mantiene la tensión constante. Y Dustin Hoffman genial.', 9, 7.6, 7.5, 9.1, 8.2, 7.4),
(944, '2016-03-22', 541, 'TV', 'Blu-Ray', 'Castellano', 'Guión complejo pero bastante elaborado. Hace que el espectador se cuestione varias veces si su nivel de atención es correcto. Sí, tranquilos, al final lo entenderéis todo. Sublime el tiroteo final (aunque imposible que Crowe viviera), como sublime también Kevin Spacey. ', 8, 7.7, 8.3, 9.9, 9.4, 8.2),
(945, '2016-03-22', 90, 'PC', 'Netflix', 'VOSE', 'Se hace larga, no lo voy a negar. Y más vista a la 1 de la mañana para que acabe a las 4. Pero las geniales escenas de lucha (la última dura alrededor de 1 hora), junto a la primera hora y media en la que se forja la amistad de los personajes (quizás excesiva en la duración, sí), más el caracter de Kikuchiyo (sin duda lo mejor de la peli) hace de esta una de las grandes obras maestras del cine japonés. Es imperdonable puntuar menos de un 9.', 9, 8.5, 8.7, 10, 9.7, 9),
(946, '2016-03-23', 66, 'PC', 'Descarga', 'VOSE', 'Contada desde el punto de vista de 3 hombres. Se trata de un retrato intimista de cada uno, en el que cada narración explora los miedos de los personajes. Toshiro Mifune genial, como siempre.', 8, 8.2, 8.3, 10, 9.3, 8.4),
(947, '2016-03-24', 978, 'PC', 'Netflix', 'VOSE', 'La película está muy bien porque mezcla elementos de comedia con el género zombi al más puro estilo George A. Romero. Un reparto bastante carismático, entretiene y sale Bill Murray, qué más se puede pedir.', 7, 6.6, 7.7, 8.9, 8.6, 7.2),
(948, '2016-03-25', 1567, 'Cine', 'Salamanca', 'Castellano', 'Para los fanáticos de los superhéroes, entre los cuales se encuentra un servidor, esta película cumple todos los requisitos para ser una película MOLONA. Recapitulemos, aparecen: Superman, Batman, Wonderwoman, Cyborg, Flash, Aquaman, Doomsday, Lex Luthor, Alfred, la batcueva, Lois Lane, ¿Joker?, etc. Jesse Eisenberg borda el papel de Lex, superando al de Kevin Spacey por goleada. Era difícil, por no decir imposible, hacerlo mejor que Christian Bale en el papel de Batman y Ben Affleck... no lo consigue, pero no está nada mal como Bruce. Y bueno, Gal Gadot es la revelación de la película. En la primera escena, barre en cuanto a profundidad psicológica  de los personajes como de guión a cualquier película (y quiero subrayar película, porque existe Daredevil) de Marvel hasta la fecha. El gran fallo de la película está en el ansia por mostrar los tortazos de los protagonistas, en el sobreuso de lo digital y en Doomsday. Hay escenas largas que parece que no tienen ni un solo actor y que todo son recreaciones digitales. No me voy sin antes mencionar el inmenso trabajo de Hans Zimmer y Junkie XL en la banda sonora. Martha.', 8, 6.4, 7.5, 2.9, 7.3, 5.8),
(949, '2016-03-26', 1175, 'PC', 'Netflix', 'VOSE', 'Bazofia de película que ni voy a criticar porque estoy cansado de ver películas así, de "comedia". Un 1 por la MILF de Cameron Diaz y su escena de lavado de coche, la cual es tan ridícula como el resto de la película. ', 1, 4.2, 5.7, 4.4, 3.6, 4.6),
(950, '2016-03-27', 1544, 'TV', 'Descarga', 'Castellano', 'Aburridísima. No te enteras de la historia hasta a mediados de la película. Normalmente, esto no suele ser un problema, y ha ocurrido en otras ocasiones como Sicario, por ejemplo. Pero aquí pasa directamente por no importante. Las escenas de "acción" son totalmente sosas y sin sustancia, al igual que sus personajes y diálogos.', 3, 5.9, 6.4, 7.8, 5.1, 7),
(951, '2016-03-27', 324, 'TV', 'YouTube', 'VOSE', 'Toda una curiosidad, la única película procediente de Corea del Norte que aparece en Filmaffinity, y es mala pero he de reconocerlo… Me ha gustado. Sí, porque tiene un mensaje detrás, Pulgasari es la clase obrera, la cual se revela, y va aumentando de tamaño, derrota al rey y es peligrosa para los demás estados y países, por lo que debe desaparecer para que haya un progreso, ¿os suena verdad? Pues a Kim Jong-Il no.', 6, 4.9, 5.1, NULL, NULL, 5.4),
(953, '2016-03-28', 1514, 'TV', 'Descarga', 'VOSE', 'Segundo visionado y la película mejora, quizás por la versión original o quizás no, pero he disfrutado como un niño con las escenas de persecución y las batallas. Es obligado meterla en una de las 10 mejores películas de este año. Quizás la primera vez me gustó menos porque esperaba más, ahora sabiendo lo que pasaba es como que es mejor. Rey y Finn OTP.', 8, 7.1, 8.3, 9.2, 8.9, 8.2),
(954, '2016-03-29', 1545, 'TV', 'Descarga', 'VOSE', 'Biografía sobre NWA y sus miembros, está muy entretenida y se pasa rápido, además con música hip hop que joder, mola mucho. También está enmarcada en el racismo y la brutalidad policial que hostigaba a la minoría negra en los 80. Muy recomendada.', 7, 7, 8, 8.8, 9.2, 7.4),
(955, '2016-03-29', 212, 'TV', 'Blu-Ray', 'Castellano', 'Está muy bien, en especial por la actuación del protagonista y su pérdida de fé en su "trabajo". Al final no tiene nada que perder. Sin embargo, me gustó más Perros de paja.', 7, 7.3, 7.5, 8.2, 8.6, 7.8),
(956, '2016-03-30', 162, 'TV', 'DVD', 'VOSE', 'Me encuentro sin palabras para describir esta película. Toda una experiencia.', 9, 8.2, 8.2, 9, 9.4, 8.8),
(957, '2016-03-31', 487, 'PC', 'Descarga', 'VOSE', 'Habiendo visto las 3, he de decir que esta trilogía es una de las razones por las que el cine fue inventado. Dirigida magistralmente por el naturalista Richard Linklater, la espontaneidad de sus diálogos, la naturalidad de las interpretaciones, el fuerte amor que une a estos personajes. He empatizado muchísimo con la historia. Me ha encantado.', 8, 7.4, 8.1, 10, 9.3, 8.4),
(958, '2016-04-01', 777, 'PC', 'Descarga', 'VOSE', 'Menor que la primera pero igualmente brillante, dado que conserva todos los rasgos de su predecesora, amor, romance, con una historia simpática y con diálogos y diálogos.', 8, 7.3, 8, 9.5, 9.1, 8.4),
(959, '2016-04-01', 1373, 'PC', 'Descarga', 'VOSE', 'Es la menor de las 3, dado que aquí vienen los problemas de la pareja, como son las fuertes discusiones por temas banales ¿o no tan banales? El proyecto de Richard Linklater da sus frutos, y 20 años después se gesta esta obra, menor como he dicho pero aun así buenísima. Aquí Julie Delpy supera a Ethan Hawke en cuanto a nivel interpretativo. Me ha dado pena terminar esta trilogía, como una buena serie que no quieres que se acabe y cuando se acaba te deja un enorme vacío.', 8, 7.3, 7.9, 9.8, 8.2, 8.4),
(960, '2016-04-02', 1546, 'TV', 'Descarga', 'Castellano', 'Bastante normalita, el ordenador y el CGI o lo que sea se carga esta película. Lo que sorprende es ver a Cillian Murphy de secundario, creo que podría aspirar a más. ¿Por qué ponen el asesinato de las ballenas como algo heroico?', 5, 6.3, 7, 4.2, 5.6, 5.8),
(961, '2016-04-03', 121, 'TV', 'DVD', 'Castellano', 'Enseguida toma el pulso narrativo y hace que no te separes de la historia hasta que sale The end. En parte, gracias al genial Spencer Tracy y a un guión que sabe combinar magistralmente la comedia y el drama y a hacer de la política un tema de todo menos aburrido.', 9, 7.6, 7.5, 8.8, 8, 7),
(962, '2016-04-04', 52, 'TV', 'Blu-Ray', 'Castellano', 'Está bien, pero se hace larga a la mitad. Destacar la actuación de Edward G. Robinson y ese encanto en la dirección de Orson Welles.', 7, 7.5, 7.4, 9.6, 8, 7.2),
(963, '2016-04-05', 697, 'PC', 'Netflix', 'VOSE', 'Horrible, esto podría haber sido una grandísima película (digo esto habiendo visto la serie, claro) pero es ridícula. Las escenas de acción están cargadas de digital que visto ahora parece cómico. La escena de presentación de Elektra es bochornosa. La relación Foggy - Matt no está bien explicada, sale por ahí Karen Page enamorada de Matt pero tampoco. De Kingpin no sabemos nada solo que es muy malo. Y Colin Farrell como Bullseye... ridículo. He sido muy generoso puntuando un 2.', 2, 4.3, 5.3, 4.4, 3.5, 4.2),
(964, '2016-04-06', 1469, 'PC', 'Descarga', 'VOSE', 'Aunque se note cuando el guión esté enfocado al público infantil, es una película muy buena a la que dudé si ponerle el 8. Es pasar un agradable rato acompañado de unas buenas risas.', 7, 7, 7.9, 8.9, 9.1, 7.4),
(965, '2016-04-07', 1374, 'PC', 'Descarga', 'VOSE', 'Creo que era innecesario hacer una película a partir de un vídeo grabado en un móvil. Porque sí, es tremenda la brutalidad policial pero la hora anterior de película es como si me hubieran tomado el pelo. Por ejemplo la escena del perro es buscar la conmoción fácil.  Octavia Spencer en su línea.', 6, 6.3, 7.5, 9.4, 8.7, 7.4),
(966, '2016-04-08', 647, 'PC', 'Netflix', 'VOSE', 'Deliciosamente perturbadora.', 9, 7.1, 8, 8.2, 8.8, 8.4),
(967, '2016-04-09', 436, 'PC', 'Descarga', 'VOSE', 'Se me ha hecho larga y aburridísima. Eso sí, Sharon Stone es de las actrices más guapas que he visto en el cine. Sé que eso no tiene nada que ver con la película pero es que no sé que otra cosa voy a comentar. La banda sonora me agobia mucho.', 3, 6.4, 6.9, 5.4, 6.3, 6.6),
(968, '2016-04-10', 1596, 'PC', 'Netflix', 'VOSE', 'Pensándolo bien no sé de dónde he sacado 3 puntos para esto. Porque es bastante floja, no aporta nada a lo que ya se supiera sobre el sexting y es bochornoso las escenas de recreación, por no hablar de lo incómodo que se hace verlas. Muy, muy mala.', 3, NULL, 3.7, NULL, NULL, NULL),
(969, '2016-04-11', 1375, 'PC', 'Descarga', 'VOSE', 'No me estaba gustando nada, pero a mitad de la peli me enganchó y creo que esta es de las que gana con un segundo visionado. Lo que irrita es lo alargada que está, pero como digo, puede que con un segundo visionado te acostumbres y pases a disfrutar de los planos y de la magnífica historia que el director de Drive nos brinda.', 6, 5.1, 5.7, 4, 3.7, 6.2),
(970, '2016-04-12', 163, 'PC', 'Descarga', 'VOSE', 'No entiendo cómo le puede gustar a la gente. Supongo que por las intenciones de los productores, de las cuales avisan antes de que empiece la película. Pero es ridículo, los trajes, los guiones, la resolución de las escenas, absolutamente todo. Las actuaciones del Joker, Riddle, Pingüino y Catwoman no son ni mediocres. Ojalá olvidarla pronto.', 1, 5.4, 6.5, 8, 6.2, 6.6),
(971, '2016-04-13', 1568, 'Cine', 'Salamanca', 'VO', 'Gran parte del encanto de la película reside en una gran pareja de actrices como son Emma Suárez y Adriana Ugarte. Juntamos eso a una banda sonora que, a veces inaudible, mantiene la tensión y la intriga constantemente y sale una película muy resultona. Es mi primera película de Almodóvar así que no conozco mucho su estilo y rasgos.', 7, 6.7, 7.2, 5, NULL, 7.2),
(972, '2016-04-14', 1176, 'PC', 'Netflix', 'VOSE', 'Me esperaba más al estar consideradas como una de las mejores películas de los 10, pero es otra película más en la que aprovechan una tragedia y la tratan de forma cómica. Me lo he pasado bien, sí, pero nada destacable salvo la actuación de Omar Sy.', 7, 8.1, 8.6, 7.5, 9.3, 8),
(973, '2016-04-15', 648, 'PC', 'Descarga', 'VOSE', 'No, no la he entendido así que sí, quizás por eso sea sólo un 7, pero es que venía de ver Mulholland Drive y no sé, como que esta es un poco basura a su lado. Y las caras de Jake Gyllenhaal cuando está loco emulando a Jack Nicholson (?). Quizás sea de esas que ganan en un segundo visionado.', 7, 7.4, 8.1, 8.5, 8, 7.8),
(974, '2016-04-16', 1490, 'TV', 'Blu-Ray', 'Castellano', 'Me da rabia no poder disfrutar esta película como se merece, pero es que en el cine busco algo más que acción y acción. Busco profundidad, unos personajes que evolucionen psicológicamente, una historia compleja… No voy a decir que no tiene guión porque tiene uno muy elaborado, pero que se reduce a: Vamos a un sitio, ese sitio no existe, volvemos a donde estábamos. Son 2 horas de puro desenfreno que se pasan volando, con unos espectaculares y asombrosos efectos, estamos hablando de una de las mejores películas en el aspecto técnico de los últimos años, pero nada más.', 7, 7.1, 8.1, 9.7, 8.6, 8.6),
(975, '2016-04-17', 571, 'TV', 'Descarga', 'VOSE', 'Estaba mejor la primera de esta saga, pero es una película corta, entretenida y fácil de ver.', 6, 5.7, 7.3, 9, 6.6, 6.4),
(976, '2016-04-17', 1525, 'TV', 'Descarga', 'Castellano', 'La he disfrutado menos que la primera vez que la vi, debido a la calidad y al doblaje, le bajaría al 7, pero voy a mantener la nota por Lubezki, eternamente tuyo.', 8, 7.4, 8.1, 8.2, 8.5, 7.8),
(977, '2016-04-18', 1547, 'PC', 'Descarga', 'VO', 'Interesante puesta en escena, pero los actores parecen recitar y leer en vez de actuar. También parece una sucesión de videoclips en muchas ocasiones. Inma Cuesta espectacular.', 6, 7.2, 7.3, NULL, NULL, 7.2),
(978, '2016-04-19', 649, 'PC', 'Descarga', 'VOSE', 'Curiosa y única. Con una mezcla de animación y realidad, Richard Linklater nos trae toda una pieza onírica, que ni el mismísimo David Lynch. La profundidad de sus filosóficas conversaciones hace que la película se pase rápido e invite a reflexionar. Además salen Jesse y Celine, para los fans de lo que por entonces era una película, pero ahora es una trilogía, Before. El mundo imaginario de Richard Linklater.', 7, 7.5, 7.8, 8, 8.7, 7.4),
(979, '2016-04-20', 1376, 'PC', 'Descarga', 'VO', 'Parece la tan manida película romántica de chico le gusta chica pero chica no quiere pero entonces le convence y van a casa. Una vez en casa todo cambia, y desde el primer momento algo raro pasa. Toda una reinvención del género romance que sirvió para ganar el primer premio Feroz, con una espectacular pareja de actores y un inesperado, aunque esperado, final.', 8, 6.5, 7.1, NULL, NULL, 6.6),
(980, '2016-04-21', 1548, 'PC', 'Descarga', 'VO', 'A priori parecía una mierda y sorprende bastante. Los efectos especiales y todas las escenas de acción son buenísimos, además tiene unos ingeniosos toques de humor. Toda una sorpresa, y más viendo por donde venía la adaptación del cómic español (Capitán Trueno, ejem).', 6, 5.8, 6.1, NULL, NULL, 6.2),
(981, '2016-04-22', 1549, 'PC', 'Descarga', 'VOSE', 'Desde el primer momento es una película opaca, no consigues ni por un segundo empatizar con la protagonista, al contrario que lo que pasa con la esquimal que allí encuentra, aunque dudo que esa fuera su intención. La pareja de actrices están espectaculares, al igual que la fotografía, pero al final no sé si era necesario hacer esta película.', 5, 6.1, 5.8, NULL, NULL, 5.6),
(982, '2016-04-23', 126, 'TV', 'Blu-Ray', 'Castellano', 'Se dice de ella que es una de las películas más entretenidas jamás realizadas, y estoy totalmente de acuerdo. Tiene algo que engancha desde el primer momento, ese algo es una magistral dirección de Alfred Hitchcock, acompañado de un perfecto guión de Ernest Lehman y una soberbia actuación de Cary Grant.', 8, 8.3, 8.4, 10, 9.4, 8.4),
(983, '2016-04-24', 77, 'TV', 'DVD', 'Castellano', 'Cuesta entrar en la película, pero una vez dentro te atrapa y no estarás a merced de ella hasta el final de la misma.', 7, 7.7, 7.9, 10, 8.9, 7.2),
(984, '2016-04-25', 1550, 'PC', 'Descarga', 'VO', 'Muy cruda, quizás demasiado. No aporta nada que no se supiera ya y aun así emociona, quizás por las perfectas interpretaciones de sus actores.', 6, 6.7, 6.9, NULL, NULL, 6.4),
(985, '2016-04-26', 1470, 'PC', 'Descarga', 'VOSE', 'Es una película simpática, dulce y brillante. Perfecta para el público infantil pero que falla quizás en el público adulto, al abusar de elementos fantásticos. Aún así, 2014 fue un gran año para el cine de animación, con títulos como La LEGO película, Big Hero 6...', 6, 7.6, 8.2, 9.9, 9.2, 8),
(986, '2016-04-27', 871, 'PC', 'Netflix', 'VOSE', 'Parece la típica historia de amor pero es algo mucho más allá. También da la sensación de estar en un documental de alguna banda, eso sí, las canciones son buenísimas.', 6, 7.3, 7.9, 9.7, 9.1, 7.6),
(987, '2016-04-28', 1551, 'PC', 'Descarga', 'VOSE', 'Sublime historia ¿de amor?, en la que lo más destacable es la actuación de Charlotte Rampling. El final es magistral.', 8, 6.7, 7.1, 9.7, 7, 7.6),
(988, '2016-04-29', 704, 'PC', 'Netflix', 'VOSE', 'Me encanta cómo combina la comedia con la acción, aunque los efectos hayan quedado totalmente desfasados, Kitano demuestra que sabe cómo contar una buena historia de forma maestra.', 8, 7.3, 7.6, 8.6, 8.8, 7.2),
(989, '2016-04-30', 1552, 'TV', 'Descarga', 'Castellano', '3 momentos de la vida de Steve Jobs en la que vemos su personalidad histrionante, una magnífica actuación de Fassbender, consagrándose como uno de los mejores actores del momento, al igual que Kate Kinslet y el regreso de B.B. la de Kill Bill.', 7, 6.2, 7.3, 8.5, 7.4, 7.4),
(990, '2016-05-01', 1553, 'TV', 'Descarga', 'Castellano', 'Tiene una banda sonora bestial y posiblemente estemos ante la mejor película de boxeo hecha desde Million Dollar Baby. Sylvester Stallone en el mejor papel de toda su carrera, y a Michael B. se le ve madera de gran estrella. Esperando ya a la secuela de lo que parece ser ya una de las mejores franquicias de los próximos años.', 8, 6.8, 7.7, 9.4, 9, 7.8),
(991, '2016-05-02', 1377, 'PC', 'Descarga', 'VOSE', 'Una idea muy simple y básica que falla en su resolución, por carecer de ella. Y no tiene nada más, se pasan los 90 minutos rápido y está acompañada de buena música. Ya.', 5, 5.1, 5.9, 7.8, 4.7, 6),
(992, '2016-05-03', 1177, 'PC', 'Netflix', 'VOSE', 'No aporta absolutamente nada al género. No sé cómo ha tenido tanto prestigio entre la crítica.', 5, 6.6, 6.7, 7.2, 6.1, 6.6),
(993, '2016-05-04', 1378, 'PC', 'Netflix', 'VO', 'La película en sí no vale para nada, pero aunque me cueste reconocerlo me he reído. Quizás haya sido molida a críticas por tener el director que tiene pero la verdad es que son unos agradables 90 minutos, con algún chiste desfasado, sí, pero igualmente divertida.', 6, 4.3, 5.6, 4.8, 3.7, 5.4),
(994, '2016-05-05', 1569, 'PC', 'Descarga', 'VOSE', 'Gamberra, muy gamberra. Deadpool es todo lo que se esperaba de ella. Yo, personalmente, cuando más me he reído son en las pullitas  a la Fox, o el gag de McAvoy  y Stewart, o la careta de Lobezno… Es una película buenísima, demostrando que una vez más el universo FOX de Marvel puede ser mejor que el MCU.', 8, 7, 8.2, 8.3, 9.2, 7.4),
(995, '2016-05-06', 357, 'PC', 'Descarga', 'VOSE', 'Simpática y muy entretenida, aunque muchas veces te haga plantearte si la intención de tal escena era hacerte reír. Mi nombre es íñigo Montoya. Tú mataste a mi padre. Prepárate a morir.', 7, 7.4, 8.1, 9.7, 9.5, 8),
(996, '2016-05-08', 1554, 'PC', 'Descarga', 'Castellano', 'Tom Hardy hace que esta película no sea tan pesada. El principal problema pasa por su narración, seguido por su historia.', 5, 6, 7, 6.2, 6.2, 6.2),
(997, '2016-05-09', 572, 'PC', 'Descarga', 'VOSE', 'Muy curiosa, aunque al final parezca que ni el propio guionista ha sabido cómo resolverla, o quizás es que no la haya entendido…', 6, 6.8, 7.5, 8.7, 8.5, 7.2),
(998, '2016-05-10', 974, 'PC', 'Netflix', 'VOSE', 'Pura basura, bazofia, scum, mierda, shit, puke, matadme, por, favor.', 1, 4, 5.5, 4.2, 5, 4.8),
(999, '2016-05-11', 925, 'PC', 'Netflix', 'VOSE', 'Me encanta este tipo de cine, a los 20 minutos ya estás totalmente atrapado y deseando saber el final. Además en el reparto se encuentran nombres como T.J. Miller, Lizzy Caplan, Theo Rossi… Volviendo a la película, el formato es el adecuado, con buenísimos efectos especiales y un nivel de tensión constante.', 8, 5.6, 7.1, 7.7, 6.8, 6.6),
(1000, '2016-05-12', 1270, 'PC', 'Netflix', 'VOSE', 'Poco que destacar, salvo las escenas de acción, quizás la animación haya quedado desfasada pero es un rato entretenido y deja un final que deja ganas de ver las siguientes.', 7, 7, 7.7, NULL, 7.4, 6.6),
(1001, '2016-05-13', 625, 'PC', 'Descarga', 'VOSE', 'Se ve la transformación de Robin (Drake, no Dick) en Joker, uno de los pocos recuerdos que tenía de la serie de Batman cuando era niño. Es curioso cómo evolucionan los personajes, Bruce pasa a ser una especie de Alfred, Joker reaparece en una forma un tanto extraña, Harley Quinn anciana con dos nietas (que han copiado totalmente su personalidad), en fin, es lo que se esperaba de ella.', 6, 6.1, 7.9, 8.8, 8.5, 7.2),
(1002, '2016-05-14', 1569, 'TV', 'Descarga', 'Castellano', 'Segundo visionado y sigue siendo igual de molona.', 8, 7, 8.2, 8.3, 9.2, 7.4),
(1003, '2016-05-15', 872, 'TV', 'DVD', 'Castellano', 'Es difícil de creer que el ser humano fuera capaz de hacer algo así. El final es tremendo y desgarrador.', 7, 8.1, 8.5, 9.3, 9.6, 8.4),
(1004, '2016-05-17', 1379, 'PC', 'Descarga', 'VOSE', 'Grata sorpresa la que me he llevado con esta película, que, si quitamos todo los elementos que tiene para llegar a un público familiar es una gran película, con un humor a veces ácido (cuando Donald se cae del árbol) que el mensaje final es del de la familia unida y tal sí, pero a mí me ha llegado a emocionar en algunos tramos. De las que pondré a mis hijos.', 7, 6.4, 7.3, 7.1, 7.8, 6.4),
(1005, '2016-05-18', 1555, 'PC', 'Descarga', 'VOSE', 'El director muestra personalidad, y la película estaría bien si la historia fuera buena, pero no es más que una mera adaptación de una novela juvenil con su estúpida historia de amor de instituto. El final es un claro ejemplo de no saber resolver un guión.', 4, 5.4, 6.4, 5.3, 4.8, 5.8),
(1006, '2016-05-19', 1556, 'PC', 'Netflix', 'VOSE', 'Simpática, curiosa y con un gran actor. Su gran problema pasa por su dirección, que parece de cartón.', 5, 6.4, 7.1, NULL, NULL, 6.6),
(1007, '2016-05-21', 257, 'TV', 'Blu-Ray', 'Castellano', 'No sé qué decir. Se supone que en un biopic tienes que empatizar con el protagonista, pero Scorsese aquí consigue todo lo contrario, consigue que hasta te alegres de sus desgracias. Robert De Niro, como siempre, hace una de las mejores actuaciones de la historia. Brutal.', 8, 8.1, 8.3, 9.7, 9.3, 8.6),
(1008, '2016-05-22', 138, 'TV', 'Blu-Ray', 'VO', 'Muchas indirectas directas a la Iglesia, genial el plano referente a la última cena, genial toda la cena en general, cómo trata la pobreza, la maldad del cristiano Fernando Rey, cómo Viridiana acaba escuchando rock con su primo mientras juega a las cartas... Magnífica.', 9, 8.1, 8.3, 10, 9, 8.2),
(1009, '2016-05-23', 1570, 'Cine', 'Ciudad', 'Castellano', 'La película falla por tantos apectos que no podría ni enumerarlos. La escena de Quicksilver, que en la primera película fue un gran acierto, aquí se hace pesada, como la película en general. Muy decepcionado viendo lo que hizo Singer en Días del futuro pasado.', 4, 6.5, 7.6, 5.2, NULL, 6.4),
(1010, '2016-05-24', 652, 'PC', 'Descarga', 'VOSE', 'Simpática, dulce y agradable. Hace reír a niños y a mí (no sé en qué grupo encasillarme todavía). Quizás falla por la moraleja impuesta por Disney sobre la familia pero es una grandiosa película recomendada para todo el mundo.', 7, 6.2, 7.2, NULL, 8.2, 7.2),
(1011, '2016-05-25', 1557, 'PC', 'Descarga', 'VO', 'Película de plástico, entretiene y cumple su papel pero nada más allá.', 5, 6.1, 6.4, NULL, NULL, 6.2),
(1012, '2016-05-29', 164, 'TV', 'DVD', 'Castellano', 'Una película de Drácula más que en unos cuantos días mezclaré con todas las que ya he visto.', 6, 6.7, 6.7, 8.5, 6.6, 6.6),
(1013, '2016-05-31', 202, 'PC', 'Descarga', 'VO', 'Película en la que se basó/plagió Canino (2009), por lo que me sabía gran parte de la historia, a pesar de eso la he disfrutado mucho, debido a la siniestra actuación de Claudio Brook. Me llamó la atención especialmente una escena en la que se pincha con un alfiler. Creo que piensa que es un Dios y no podía sangrar. Desde los nombres de sus hijos (Utopía, Porvenir y Voluntad) hasta la claustrofobia que desprende, es una genial película.', 8, 7.2, 7.7, NULL, 8.1, 7),
(1014, '2016-06-01', 1558, 'PC', 'Descarga', 'VO', 'Patética a más no poder, hasta Penélope Cruz chirría a veces. Nada, nada bien en esta película.', 3, 5.6, 6, 1.1, 5.6, 5.4),
(1015, '2016-06-02', 1571, 'PC', 'Descarga', 'VOSE', 'Pues qué queréis que os diga, a mí me ha gustado, me he reído mucho con las actuaciones de Ben y Owen. La he puntuado más que a la primera pero no es mejor. Aunque sale Susan Sarandon diciendo "touch-a touch-a touch-a touch me, I wanna be dirty" y es que solo por eso me había ganado ya.', 6, 4.4, 4.9, 2.4, 2.4, 4.2),
(1016, '2016-06-03', 688, 'PC', 'Netflix', 'VOSE', 'Tras haber visto la magistral serie esta película se queda corta y me es inevitable llevarla a comparaciones. El genial Hannibal de Hopkins quedó eclipsado por el de Mikkelsen. El acertado Will de Norton sucumbe ante del de Dancy. En esta película quizás falle el pulso narrativo, y Ralph Fiennes, que (sorpresa) lo hizo mejor Armitage.', 6, 6.5, 7.2, 6.9, 7.4, 6.4),
(1017, '2016-06-04', 1572, 'Cine', 'Ciudad', 'Castellano', 'Quizás a los fans les haya gustado,  yo iba con las expectativas altas tratándose del director que se trata pero nada, se me hizo larga y aburridísima. Por lo menos las escenas de acción están bien y tiene posiblemente los mejores efectos especiales hechos hasta el momento. A mí, como jugador de Hearthstone, esta película es como ver a los personajes moverse y por eso me parecía una buena idea pero no.', 5, 6.6, 7.9, 2.1, NULL, 6),
(1018, '2016-06-06', 1559, 'PC', 'Descarga', 'VO', 'Es interesante y se pasa rápido, aunque al final no la he entendido muy bien, no está explicado o no se aprecian las intenciones de los personajes. Maribel Verdú genial como siempre.', 6, 5.9, 6, NULL, NULL, 5.8),
(1019, '2016-06-07', 817, 'PC', 'Descarga', 'VOSE', 'Pierde por completo la frescura que caracterizaba la anterior, aún así tiene golpes buenos, pero la historia es demasiado simple y fácil. Como si no se la hubieran currado nada.', 5, 5.2, 6.3, NULL, NULL, 5.6),
(1020, '2016-06-08', 1507, 'PC', 'Descarga', 'VOSE', 'Dulce y simpática, con una gran actriz al frente ', 7, 7.2, 7.9, 9.6, 9.2, 8),
(1021, '2016-06-09', 183, 'PC', 'Netflix', 'VOSE', 'Se le va la pinza en las escenas de colgados, y la película es muy simple pero mola mucho. Tiene un gran trío de actores.', 7, 7.1, 7.4, 8.9, 8.2, 7.4),
(1022, '2016-06-10', 229, 'PC', 'Netflix', 'VOSE', 'Es oficialmente la película más rara que he visto. Y sí es un 6 para no parecer que no la he disfrutado, porque sería mentira, pero es que no me he enterado muy bien de qué iba la película.', 6, 6.8, 7.4, 9.1, 8.3, 7.8),
(1023, '2016-06-11', 1560, 'TV', 'Descarga', 'Castellano', 'No me enganchó desde el principio y luego se convirtió en una película romántica más. Con una grandiosa actriz, eso sí.', 5, 6.7, 7.5, 9.7, 8.8, 7.4),
(1024, '2016-06-12', 1573, 'TV', 'Descarga', 'Castellano', 'La nueva de los Coen, y por ser de quien es se esperan cosas, muchas cosas… que no se cumple ni una. Falla por todos los aspectos, meten lo de los comunistas con calzador, todo está mal, salvo algún que otro gag.', 4, 5.5, 6.5, 8.5, 4.6, 6.8),
(1025, '2016-06-14', 1561, 'PC', 'Netflix', 'VOSE', 'A caballo entre la comedia y el cine de acción, una película con la que la crítica ha sido injusta, pues hacer una película entretenida teniendo tan mala actriz principal es difícil, solo se puede hacer teniendo un gran actor principal, si añadimos Tim Roth a la mezcla, sale una película entretenida para pasar el rato.', 5, 5.2, 6.3, 3.6, 5.6, 5.4),
(1026, '2016-06-15', 1380, 'PC', 'Netflix', 'VOSE', 'Toda una pequeña joya del cine independiente. Decir que es "la nueva Drive" quizás se le quede grande, pero cerca. La película es como un puzzle que vas descubriendo poco a poco, hasta la escena final que se da la pieza clave para resolverlo.', 8, 6.2, 7.1, 9.6, 7.9, 7.4),
(1027, '2016-06-18', 1562, 'TV', 'Descarga', 'Castellano', 'Una de las mejores películas del pasado año, tantas cosas buenas que no sé por dónde empezar, así que comenzaré por donde todo el mundo, Jacob Tremblay, posiblemente una de las mejores actuaciones que se han visto en un niño de los últimos años, Brie Larson tampoco se queda atrás. Quizás la película decaiga un poco en el momento que salen de la caseta, pero ver cómo se adaptan a la sociedad es un reto que el director sabe llevar con maestría. En fin, una buenísima película.', 8, 7.8, 8.3, 9.4, 9.4, 8.2),
(1028, '2016-06-19', 1563, 'TV', 'Descarga', 'Castellano', 'Por el título en español, me imaginé una película repleta de acción en la que al final el protagonista se iba a quedar a 13 minutos de matar a Hitler, pero no. Esto sucede en los primeros 10 minutos y por sorpresa, la película se sabe manejar bastante bien. Al principio el flashback aburre, pero una vez entras en la historia y empatizas con su tierna pareja, te conviertes en uno más de la historia. Al final los 110 minutos han pasado y no te has dado cuenta.', 6, 6.2, 7, 6.1, 4.6, 6.6),
(1029, '2016-06-21', 1271, 'PC', 'Netflix', 'VOSE', 'Mucho mejor que la primera y previsiblemente peor que la tercera. La batalla que ocupa durante más de la mitad de la película es espectacular. Quizás cuando termina y surge el conflicto entre Griffith y Guts la acción decae pero no deja de ser una película bastante notable.', 7, 7.1, 7.9, NULL, 8.2, 7),
(1030, '2016-06-24', 1564, 'TV', 'Descarga', 'Castellano', 'Sorpresiva historia de venganza. Un Kill Bill de la tercera edad. Cuenta con una genial interpretación de Chistopher Plummer, el cual visita a distintos hombres con el nombre de la persona que mató a su familia. La manera en que utiliza sus recursos, y cómo sabe resolver hace de esta película una grata sorpresa.', 7, 6.4, 7.3, 7.1, 8, 6.4),
(1031, '2016-06-25', 53, 'TV', 'Descarga', 'Castellano', 'El increíble inicio y el increíble final hace que lo del medio sea increíble por igual, sumado a una gran fotografía y unas interpretaciones memorables.', 7, 7.6, 6.9, 8.1, 5.4, 6.6),
(1032, '2016-06-27', 139, 'TV', 'Descarga', 'Castellano', 'Son 3 horas pero se pasan muy rápido, debido a una inmensa actuación de Burt Lancaster y al genial debate moral que plantea, ¿los jueces nazis cumplían su deber? Además, las imágenes a modo de documental son tremendas y aterradoras.', 7, 8.1, 8.3, 9, 9.3, 8),
(1033, '2016-06-28', 115, 'TV', 'Descarga', 'VO', 'Curiosa pero no me termina de convencer, las actuaciones son horribles y el guión no tiene el rumbo claro.', 4, 6.2, 7.3, NULL, 4.2, 6.8),
(1034, '2016-06-29', 689, 'TV', 'Descarga', 'Castellano', 'Tremenda por lo real que parece. La historia la escriben los vencedores, y de ahí el final y cómo se desarrolla la película. La actuación de Ulrich Mühe puede estar a la altura de la de Ralph Fiennes en La lista de Schindler.', 7, 7.1, 7.3, 6.7, 8.2, 6.6),
(1035, '2016-06-30', 1471, 'TV', 'Descarga', 'Castellano', 'Sin rumbo y sin emoción, el director de Room hace esta película que no he conseguido entrar en ella desde el primer momento.', 5, 6.2, 7, 9.1, 7.2, 7),
(1036, '2016-07-01', 583, 'TV', 'Blu-Ray', 'Castellano', 'Hará cuestionarte todo. Que logre tan solo ese efecto, sumada a las escenas de acción, con unos efectos notables efectos especiales, hace de esta película un clásico instantáneo.', 8, 7.9, 8.7, 8.7, 8.5, 8.4),
(1037, '2016-07-03', 36, 'TV', 'Descarga', 'VO', 'La película es una mierda, y me puedo cagar en los muertos de Franquito a gusto así que un 1. Diálogos fascistas, los rojos son sucios desarrapados cuyo hobbie es quemar iglesias y matar curas, y ensalza la figura del patriota. Las actuaciones son deplorables, a la altura de los diálogos. Sólo un enfermo podría hacer algo así.', 1, 3.4, 2.8, NULL, NULL, NULL),
(1038, '2016-07-04', 838, 'TV', 'Blu-Ray', 'Castellano', 'Interesante más que otra cosa. Entretenida, para pasar el rato. Esto se debe a que Tony Scott está bastante contenido y la idea es buena.', 6, 6.2, 7, 5.5, 7.3, 6.2),
(1039, '2016-07-05', 488, 'TV', 'DVD', 'Castellano', 'Viva la revolución. Abajo el fascismo. Viva el comunismo. Abajo el anarquismo.', 7, 7.3, 7.6, 8.2, 9.4, 7.4),
(1040, '2016-07-07', 326, 'TV', 'Descarga', 'Castellano', 'Un racista de mierda intentando imponer justicia en Chinatown cargándose al jefe de la Triada. Y poco más. Pocos rasgos se ven del director de El cazador.', 5, 6.7, 6.9, 6, 5.2, 6.8),
(1041, '2016-07-08', 1381, 'TV', 'Descarga', 'VOSE', 'Me he llevado una decepción enorme al ver esta película. La juventud es una de mis cintas favoritas y me esperaba mucho más de esta. El estilo es el mismo, sí, pero los abundantes diálogos, los personajes burgueses y el humor mal entendido hacen de esta una obra mucho más densa y pesada. Quizás en un futuro revisionado gane.', 6, 7.4, 7.7, 9.1, 8, 7.8),
(1042, '2016-07-09', 184, 'TV', 'Descarga', 'Castellano', 'Ha triunfado más por su ideología que por su calidad artística, siendo esto último bastante notable.  La fotografía y banda sonora son buenísimas y quizás falle a la hora de plantear los personajes y en los diálogos, y que todo es confuso al principio.', 7, 7.8, 8.2, 9.5, 9.3, 8.2),
(1043, '2016-07-09', 1565, 'TV', 'Descarga', 'Castellano', 'Incomprensiblemente bajas notas en críticas, esta película, junto a Expediente Warren e It Follows pasarán a la historia del terror. Se convierten en clásicos instantáneos. En esta ocasión, quizás falle en la resolución de la película, pues quizás los espectadores queríamos algo más, aunque tampoco sabríamos concretar qué. Siguiendo la pista a este director desde ya.', 8, 6.1, 6.8, 9.1, 5.5, 7.6),
(1044, '2016-07-10', 283, 'TV', 'Descarga', 'Castellano', 'Más formada que Z, con una inmensa interpretación de Jack Lemmon, Costa-Gavras relata una historia que desgraciadamente fue real.', 7, 7.8, 7.8, 9.6, 8.5, 7.4),
(1045, '2016-07-11', 195, 'TV', 'Descarga', 'Castellano', 'Podrán quemar a los cuerpos, pero nunca a las ideas. Me ha conmovido esta película. Sus actuaciones, su historia, su todo. Una de esas de las que te dan ganas de ser más subversivo si todavía se puede. Todo un must-see del cine rojo (o negro).', 8, 7.4, 7.9, 4, 9, 7.2),
(1046, '2016-07-12', 573, 'TV', 'Descarga', 'Castellano', 'Interesante proyecto psico-sociológico que me recuerda a La ola en muchos momentos. Pero la historia no da para mucho y tienen que alargarlo y ese es el principal fallo de la película.', 5, 6.4, 6.7, 5.3, 5.7, 6.2),
(1047, '2016-07-13', 1567, 'TV', 'Descarga', 'Castellano', 'Segundo visionado y suscribo punto por punto lo que dije en el primero.', 8, 5.9, 7, 2.7, 6.6, 5.6),
(1048, '2016-07-15', 1472, 'PC', 'Descarga', 'VOSE', '¿Quién iba a decir que la crítica iba a suspender esta película? Hay algunos críticos que deberían tener prohibído ver ciertas películas porque se sabe su opinión de antemano. ¿A mí? Me ha parecido una película bastante entretenida, con algun gag con gracia. Lo que sobra es Megan Fox hipersexualizada.', 6, 4.9, 5.9, 2.2, 5.1, 4.6),
(1049, '2016-07-15', 1516, 'TV', 'Blu-Ray', 'Castellano', 'La primera hora sobra. A partir de ahí es una obra maestra redonda. De las de la marca Quentin.', 8, 7.3, 7.9, 7.5, 7.6, 7.8),
(1050, '2016-07-17', 1289, 'TV', 'Blu-Ray', 'Castellano', 'Originalmente tenía un 8 y ahora le bajo al 7 por el exceso de peleas y acción y revivir a personajes principales muertos que está muy visto.', 7, 6.8, 7.8, 8.6, 9, 6.8),
(1051, '2016-07-19', 1574, 'TV', 'Descarga', 'Castellano', 'Una americanada más en el que los soldados son unos héroes y los mulsumanes malos malos. Las escenas de acción están bien.', 5, 6.2, 7.4, 5.1, 8.4, 6.2),
(1052, '2016-07-20', 650, 'PC', 'Descarga', 'VO', 'Solo he visto ma ma de este director y era bastante parecida a esta pero más contenida. Aquí o no me he enterado o no se entiende la mitad de las cosas y el porqué de su suceso. Da la sensación de que quiere ser más compleja de lo que quiere ser. No vale para nada.', 3, 6.3, 7.2, 7.1, 8.6, 6.6),
(1053, '2016-07-20', 1473, 'TV', 'Descarga', 'Castellano', 'No se entiende nada, el guión falla por todas partes, las actuaciones son penosas, no se explica el pasado de los protagonistas y parecen dos chavales cualesquiera, muy mala.', 2, 5.6, 6.1, NULL, NULL, 5.8),
(1054, '2016-07-21', 873, 'TV', 'Blu-Ray', 'Castellano', 'Cualquier nota correspondería con lo que he visto, desde el 1 hasta el 10, pero le pongo un 5 por la decepción que me ha supuesto tras ver la obra maestra Mulholland Drive. En mi opinión, Lynch, al ver que Mulholland Drive no era tan incomprensible como él pretendía, hizo esta en venganza a todos los guays que la entendieron. Esta me ha tenido perdido durante las prácticamente 2 horas desde que abandona el argumento lineal de la película que están rodando. La música es sublime, pero no voy a valorar positivamente algo que no me ha gustado, aunque no se haga larga.', 5, 6.4, 7, 7.2, 7.5, 7.2),
(1055, '2016-07-23', 394, 'TV', 'Descarga', 'Castellano', 'No es de mis favoritas de Costa-Gavras pero cuenta con una potente interpretación de Lange y una asombrosa historia.', 8, 7.3, 7.3, 7.5, 7.6, 6.6),
(1056, '2016-07-24', 542, 'TV', 'Blu-Ray', 'Castellano', 'No se ve ni un solo rasgo de la dirección de Scorsese, pero la película es bastante interesante para conocer el estilo de vida de los budistas tibetanos.', 6, 6.2, 7, 7.6, 7.9, 6.6),
(1057, '2016-07-25', 241, 'TV', 'Blu-Ray', 'VOSE', 'Una joya del cine. Una de mis películas favoritas sin duda alguna. La fotografía, la banda sonora, el Nosferatu de Klaus Kinski, todo es genial. La danza de la muerte, la aceptación amistosa del final de la vida, me encanta. Y además el placer de verla en Blu-Ray.', 9, 7.2, 7.6, 9.4, 8.3, 7.8),
(1058, '2016-07-26', 213, 'TV', 'Blu-Ray', 'Castellano', 'Me aburrió enormemente la mayor parte de la duración pero el final es tan soprendente que hizo que el resto me gustara. También hay que tener en cuenta el contexto en el que se sitúa la obra, entre El Padrino y El Padrino II, hace que tenga más mérito todavía.', 6, 7.3, 7.9, 9.8, 9, 8.4),
(1059, '2016-07-28', 902, 'TV', 'Blu-Ray', 'Castellano', 'Tengo cierto cariño a esta cinta. Repleta de simbología, supone un estudio bastante interesante de cómo se organizaría la población ante una situación de crisis en un estado cerrado. La religión entorpecería las cosas, como siempre, los racionales serían pocos, estarían unidos y serían los valientes que se atreverían a salir de la caverna. El final es desolador, pocas veces se vio un final tan desgarrador en la historia del cine.', 8, 6.4, 7.2, 7.3, 6.5, 6.8),
(1060, '2016-07-29', 1057, 'TV', 'Blu-Ray', 'Castellano', 'La disfruté muchísimo más la primera vez que la vi, ahora me ha parecido un desfile de sustos sin sentido, pero me gusta como a medida que te vas adentrando en la película las cosas que antes daban miedo van dejando de darlo y se convierten en cosas conocidas.', 6, 5.8, 6.8, 6.6, 6.2, 6.2),
(1061, '2016-07-30', 1575, 'Cine', 'Ciudad', 'Castellano', 'Sucesión interminable de planos rápidos y escenas de acción y Matt Damon corriendo de un lado a otro. Aburridísma.', 4, 6.3, 7.2, 5.7, 6.6, 6),
(1062, '2016-07-31', 377, 'TV', 'Descarga', 'Castellano', 'El racismo al sur de los Estados Unidos era algo bien conocido por todos, pero no eres consciente del peligro en el que viven las personas de color hasta que no ves películas como esta. Gene Hackman, como siempre genial.', 8, 7.5, 7.8, 8.9, 9, 7.4),
(1063, '2016-08-02', 1037, 'TV', 'Descarga', 'Castellano', 'Al principio parecía que el argumento iba a tratar de los problemas que le surgieron a Darwin para presentar su obra "El origen de las especies" pero se deja llevar por la historia de la hija, la cual resulta de poco interés y está metida forzosamente.', 3, 6.1, 6.7, 4.6, 4.9, 6.2),
(1064, '2016-08-07', 1607, 'PC', 'YouTube', 'VO', 'Tremendo docuental. De principio al final. Explica a la perfección todo, desde un punto de vista objetivo y con abundantes referencias. Estados Unidos dando asco como siempre. La izquierda aguantando, como siempre. El pueblo unido, ¿cómo siempre?', 8, 8.1, 8.3, NULL, 8, 8.2),
(1065, '2016-08-11', 1608, 'PC', 'YouTube', 'VO', '"Sigan ustedes sabiendo que, mucho más temprano que tarde, se abrirán las grandes alamedas por donde pase el hombre libre para construir una sociedad mejor."', 8, 8.1, 8.2, NULL, 8.3, 8),
(1066, '2016-08-12', 1609, 'PC', 'YouTube', 'VO', 'Tercera parte en el que no sigue la historia, si no que retrocede y habla de cómo se organizó el pueblo ante los bloqueos de Norteamérica o las huelgas organizadas por la oposición. Crear, crear, Poder Popular.', 6, 8, 7.9, NULL, NULL, 7.6),
(1067, '2016-08-12', 1403, 'TV', 'Blu-Ray', 'Castellano', 'Subo del 8 al 9 esta maravillosa cinta, con todos los elementos perfectamente fijados y un guión redondo. La banda sonora es remarcable, como lo es también la historia y las teorías que propone.', 9, 7.8, 8.6, 7.1, 8.5, 7.8),
(1068, '2016-08-13', 1610, 'PC', 'YouTube', 'VO', 'Aunque se vea de qué pie cojea, está muy bien para iniciados en el tema como yo, pues ilustra bastante bien.', 7, 7.5, 7.5, NULL, 8.4, NULL),
(1069, '2016-08-14', 1611, 'PC', 'YouTube', 'VO', 'Desgraciadamente todo esto fue real. "La memoria obstinada" supone un interesante ejercicio de recuerdo. Las lágrimas del final, lo dicen todo.', 7, 7.3, 7.9, NULL, 8.6, 7.2),
(1070, '2016-08-14', 1612, 'TV', 'Descarga', 'Castellano', 'Si la película hubiera ido de Biko hubiera estado bien. Se hace pesadísima y sosa.', 3, 6.9, 7.5, 8.1, 8.8, 6.8),
(1071, '2016-08-15', 1613, 'TV', 'Descarga', 'Castellano', 'Anticomunismo típico americano, esta vez encubierto con una historia aburrida y sin gancho.', 3, 5.8, 6.4, 6.4, 4.2, 6),
(1072, '2016-08-16', 1614, 'TV', 'DVD', 'VOSE', 'Extravagante película que creo que no he podido disfrutar quizás debido a mi edad. Tanto la fotografía como la banda sonora son magistrales.', 6, 7.9, 8.2, 10, 9.2, 8.6),
(1073, '2016-03-28', 1606, 'PC', 'Descarga', 'VOSE', 'Primera película de animación de DC. Mafia, crimen organizado y detectives hacen de esta una película bastante entretenida, y el Joker (con la voz de Mark Hamill) hace una aparición estelar. En definitiva, una de esas películas para guardar y ponérsela a mis hijos en un futuro.', 7, 6.4, 7.9, 8.1, 8.8, 7.6),
(1074, '2016-08-27', 1615, 'PC', 'Descarga', 'VOSE', 'Era muy fácil hacer una película digna, dado que esta básicamente se limita a adaptar literalmente cada fragmento del cómic, salvo 1 o 2 excepciones o escenas que son añadidas para darle  una mayor acción. La primera media hora es puro relleno y totalmente sobrante.', 5, 5.7, 6.7, 4.8, 5.3, 5.6),
(1075, '2016-08-31', 1616, 'Cine', 'Zamora', 'Castellano', 'Una película más de Woody Allen en la que un lío amoroso se interpone a las vidas habituales de los personajes. Destacar la actuación de Kristen Stewart, que se va quitando los gestos vampirescos y puede convertirse en una grandísima actriz.', 7, 6.8, 7.1, 7.1, 6.6, 6.6),
(1076, '2016-09-05', 1617, 'TV', 'Descarga', 'Castellano', 'Puede ser la película más profunda del MCU hasta la fecha y posiblemente la que más me ha gustado. La idea de fondo es buenísima, deben dejar de ser una organización privada, si bien es cierto que algunos personajes no están lo suficientemente trabajados, el introducir a Spider-Man es genial. Aquí por lo menos la resolución de la pelea no ha sido Martha.', 7, 7, 8.1, 9, 9, 7.6);
INSERT INTO `fechastitulos` (`id_visionado`, `fecha`, `id_titulo`, `medio`, `formato`, `audio`, `comentario`, `puntuacion`, `filmaffinity`, `imdb`, `tomatometer`, `audiencescore`, `letterboxd`) VALUES
(1077, '2016-09-06', 1618, 'TV', 'Descarga', 'Castellano', 'Es muy interesante cómo plantea la vida y la muerte. Primero vemos que cuando Brendan Gleeson intenta matar a Colin Farrell, es el acto de suicidarse de este lo que le detiene. Más tarde se ve cuando Ralph Fiennes intenta matar a Brendan, es el no resistirse lo que le detiene, pero en el momento en el que se resiste acaba con él, todo esto con la metáfora de que salvó al niño de la embarazada hacen de este film una grata sorpresa.', 7, 6.6, 8, 8.4, 8.6, 8),
(1078, '2016-09-07', 690, 'PC', 'Netflix', 'Castellano', 'La mejor película de la historia, con chistes de mierda, actuaciones de mierda, todo lo más irritante posible y  todo esto con una excéntrica fotografía de Lubezki, si es que le debería dar un 10.', 2, 3.5, 3.8, 1, 3, 3.6),
(1079, '2016-09-08', 1619, 'TV', 'Blu-Ray', 'Castellano', 'Perfecta desde el primer momento hasta el último. Con unos diálogos absolutamente geniales, una escena judicial que sin proponérselo es de las mejores de la historia, una actuación de Gregory Peck sencillamente genial. No hay nada que desentone en esta maravillosa cinta.', 9, 8.3, 8.4, 9.1, 9.3, 8.2),
(1080, '2016-09-08', 1620, 'PC', 'YouTube', 'VOSE', 'No pone en situación sobre cómo estaba Burkina Faso antes de la llegada de Thomas Sankara al poder y tampoco explica muy bien lo que transcurre mientras. La historia es interesante pero nada más.', 5, NULL, 8.2, NULL, NULL, NULL),
(1081, '2016-09-09', 1621, 'TV', 'Blu-Ray', 'Castellano', 'El patriotismo de la primera parte contrarresta a lo desagradable que es la segunda. Toda una llamada contra la guerra, en la cual Estados Unidos nunca pintó nada. Destacar la banda sonora.', 7, 6.7, 7.2, 9, 7.6, 7),
(1082, '2016-09-10', 554, 'PC', 'Descarga', 'Castellano', '', 10, 7.7, 8.2, 8.1, 9.4, 4.2),
(1083, '2016-09-12', 1622, 'TV', 'Blu-Ray', 'VOSE', 'La película de la clase obrera. Con toda lo que ello conlleva tanto para mi persona como para mi lucha.', 9, 8.3, 8.1, 10, 8.8, 8),
(1084, '2016-09-13', 1623, 'TV', 'Descarga', 'Castellano', 'Tiene escenas de acción bastante interesantes, y lo de las 8 pruebas es original pero es un remake totalmente innecesario.', 5, 4.5, 5.3, 0.9, 3.1, 4),
(1085, '2016-09-14', 1624, 'TV', 'DVD', 'Castellano', 'Se le puede tildar de pedante en ocasiones, como las soporíferas conversaciones entre él y ella. Es preciosista, sí. ¿Bella? Venga, vale. ¿Aburrida? Sí. ¿Pretenciosa? Por supuesto.', 6, 7.8, 8.1, 9, 9.4, 8.6),
(1086, '2016-09-25', 1625, 'TV', 'Descarga', 'Castellano', 'No llega ni a interesante, nada reseñable, personajes planos, guión plano, muy normalucha.', 5, 6.4, 7.6, 9.5, 8.6, 7.4),
(1087, '2016-09-28', 1626, 'Cine', 'Salamanca', 'VO', 'El formato interrumpe muchas veces con la narrativa, la voz en off es irritante, la cámara lenta es excesiva y aunque la banda sonora es bestial, no compensa conque la historia es algo más simple de lo que quiere aparentar.', 6, 7, 7.6, 8, NULL, 6.8),
(1088, '2016-10-02', 1627, 'TV', 'DVD', 'Castellano', 'Una película encantadora. Atrapa de principio a fin. Sin bien es verdad que la actuación de Jennifer Jones deja mucho que desear, la historia es tan buena que se hace sola. La fotografía juega constantemente a cambiar de luces, tonos sepias, tonos verdes, estética de cuadro... Una experiencia mágica.', 7, 7.8, 7.8, 9.1, 8.5, 7.4),
(1089, '2016-10-05', 1628, 'Cine', 'Salamanca', 'Castellano', 'Nada en esta película está puesto al azar. Desde la mirada del gato, impasiva, hasta las figuras de Navidad al final. Verhoeven cuenta con maestría una historia sobre el deseo y la perversión, ayudado en gran parte por una genial Isabelle Huppert. Muchas escenas están cargadas de un humor negro difícil de apreciar, e incluso que hará culpable al espectador de reírse en algunas ocasiones. Es compleja y quizás inverosímil. De esas que ganan con segundas lecturas.', 7, 7.1, 7.5, 9.2, NULL, 7.6),
(1090, '2016-10-08', 1629, 'TV', 'Descarga', 'Castellano', 'Puede pecar de efectista, y peca. Creo que James Wan es el nuevo Shyamalan, con todo lo que ello conlleva, es decir: Un director que era muy bueno, tenía mucho talento cuando era independiente y después se vendió y solo sabe fabricar productos precocinados y escenas rodadas por productoras. Con todo eso, no es tan buena como la primera porque estaba muy difícil, pero da buenos sustos, aunque previsibles.', 7, 6.8, 7.6, 8, 8.3, 7),
(1091, '2016-10-09', 1630, 'TV', 'Descarga', 'Castellano', 'Good morning Vietnam, no esto no es una prueba de micro, esto es rock and roll, a rockandrollear [...] Genial, ¿qué es la zona desmilitarizada? ¿Y qué significa pacificación? ¿Un general que dice "cogemos un par de B29 y os pacificamos en pequeños trocitos"?<br>Lo mejor de esta película es sin duda Robin Williams y su magnética actuación. La BSO también está muy bien.', 7, 6.7, 7.3, 8.9, 8.2, 7.2),
(1092, '2016-10-15', 1631, 'TV', 'Descarga', 'Castellano', 'Bastante regular y aburrida. Pintan a Mussolini como demasiado humano y a los rojos como auténticos salvajes. Aparte de eso no tiene nada destacable, ni siquiera un Henry Fonda totalmente fuera de lugar.', 4, 6.2, 6.5, NULL, 2.9, NULL),
(1093, '2016-10-16', 1632, 'PC', 'Descarga', 'Castellano', 'Una película bastante interesante, mal llevada desde el punto de vista narrativo. <strike>Trostsky era un cerdo traidor y bien muerto está</strike>', 5, 5.4, 6, NULL, 3.8, 6.2),
(1094, '2016-10-30', 1633, 'PC', 'Netflix', 'VO', 'Pretenciosa, los actores no están al nivel salvo uno, el guión es horrible y la forma de resolución es la peor de todas. Quizás sea duro porque me ha entretenido bastante y se pasa muy rápida.', 4, 6.7, 7, NULL, NULL, 6.4),
(1095, '2016-10-31', 1634, 'PC', 'Descarga', 'VOSE', 'Tremenda por su dureza, como es natural en un documental sobre este tema, con imágenes reales. El liricismo con el que el narrador acompaña toda la cinta hace de éste un documental mágico y sublime.', 8, 8.2, 8.6, 10, 9.5, 8.6),
(1096, '2016-10-31', 1635, 'PC', 'Descarga', 'VO', 'Es innegable y también era imposible superar a la original, pero creo que ni lo han intentado. Debido a mi inmenso fanatismo por la primera, he de decir que he disfrutado esta como un niño, y Laverne Cox está magnética. Se sabía de antemano todo lo que podía dar de sí, y ha cumplido fielmente esas bajas expectativas.', 7, 4.9, 4.4, 2.9, 2.1, 4.6),
(1097, '2016-11-02', 1636, 'Cine', 'Salamanca', 'Castellano', 'Si quitamos todos los chistes racistas, machistas, xenófobos (en general, clasistas) tiene buenos puntos y supone una interesante reflexión vegana (ja, ja). Yo creo que esto fue producto de una noche loca de drogas entre Evan Goldberg y Seth Rogen, y este es el resultado. Recomendada para pasar un buen rato, pero para nada más.', 6, 5.6, 6.5, 8.3, 5.6, 6),
