(3041, '2016-01-31', 3713, 'PC', 'Netflix', '', 'Voy a hacer este comentario con la canción de los créditos aún sonando. Aunque no tengo muchas palabras que decir. Tengo que agradecer a los hermanos Wachowski todo lo que me han hecho sentir con esta serie, con estos 8 personajes, porque han sido todos los sentimientos. La odié en su primer capítulo. La amé en todos sus demás. Amé los 8 personajes, porque desprenden carisma y valores, valores que los unen y los complementan para hacer uno solo. Uno invencible. Acabo uno de las mejores series del año, con uno de los mejores capítulos del año y deseo que salga ya la segunda temporada. Quiero celebrar el 8 de agosto como si fuera mi cumpleaños. Qué largo se me va a hacer este año.', 0, NULL, NULL, NULL, NULL, NULL),
