(3146, '2016-03-21', 3818, 'TV', 'Netflix', '', 'No nos vamos a engañar, la primera temporada estaba mejor. ¿Decir eso significa que esta temporada no sea notable? En absoluto. Pero la primera era una obra maestra. Puede que sea la marcha de DeKnight , o que gran parte del encanto de la primera residía en esperar el traje y aquí lo dan hecho. The Punisher tiene una atracción increíble, la misma que Elektra y Stick (que ya vimos en la primera), pero no sé muy bien qué falla. Quizás las idas y venidas de The Punisher, que tan pronto dice que no volverá a matar como vuelve a hacerlo. Y esa doble moral de Matt, como si de la teoría de Platón se tratara, Elektra es su parte irascible, y se siente tentado y atraído por ella. Mientras que Elektra se ha mantenido así siempre, salvo al final. Seguramente no esté muerta. En un año lo sabremos. Ah, ni que decir tiene que tanto estas 2 temporadas como, en menor medida, la primera de Jessica Jones son infinitamente supreriores que cualquier producto marvelita hasta la fecha.', 0, NULL, NULL, NULL, NULL, NULL),
