(3768, '2016-11-06', 4440, 'PC', 'Descarga', 'Castellano', 'El pobre burgués de Ben Affleck ha perdido el trabajo y tiene que vender su descapotable, ¡pobrecito! <br>Asquerosa película capitalista.', 4, 6.1, 6.8, 6.7, 5.5, 6),
(3769, '2016-11-07', 4441, 'PC', 'Descarga', '', '', 0, NULL, NULL, NULL, NULL, NULL),
