(3772, '2016-11-08', 4444, 'PC', 'Netflix', 'VOSE', 'Es un lujo poder ver esto en 1080. Imágenes bellísimas. Carencia total de guión.', 6, NULL, 8.3, NULL, NULL, NULL),
(3773, '2016-11-08', 4445, 'PC', 'Descarga', '', '', 0, NULL, NULL, NULL, NULL, NULL),
