(3775, '2016-11-09', 4447, 'PC', 'Descarga', '', '', 0, NULL, NULL, NULL, NULL, NULL),
(3776, '2016-11-09', 4448, 'Cine', 'Salamanca', 'Castellano', 'Visualmente es una pasada. Alucinante. Muchas veces el espectador sucumbirá ante la maravilla de los efectos especiales y no buscará lógica ni sentido a las escenas. Y es que yo nunca he visto nada igual. Quitando eso, es una película más de Marvel, no puedo ser nada objetivo con el villano, ya que es mi actor favorito, pero a mí me parece una interpretación bastante buena, al igual que la de Benedict. Los gags, tan recurrentes en todo el MCU, aquí se dotan de inteligencia y hacen la película mucho más llevadera, aunque en ningún momento decaiga ni aburra. ', 7, 6.9, 8, 9, 9.1, 7.2),
