(3804, '2016-11-19', 4476, 'TV', 'Descarga', '', 'Un final de temporada a la altura de lo que ha sido toda esta temporada: Sobresaliente.<br>Se echaba de menos una temporada tan magnífica y después de haber sufrido el bodrio de Hotel e irse de vacío en todos los premios, se decide innovar de esta manera, haciendo algo que estaba muy visto en el cine pero pionero en televisión.<br>Así que toca dar las gracias a Ryan Murphy, Bradley Buecker y en general a todo el equipo de American Horror Story por habernos traído este regalazo. Vuelvo a confiar en vosotros.', 0, NULL, NULL, NULL, NULL, NULL),
