(3814, '2016-11-21', 4487, 'PC', 'Netflix', '', 'Es innevitable que el nivel de Netflix y Marvel ha bajado desde aquella lejana primera temporada de Daredevil, desde entonces ha habido Jessica Jones, segunda de Daredevil y ahora era el turno de Luke Cage.<br>Ambientada en Harlem y con todo el rollo racista y violencia policial que sufre la población negra. Me ha gustado bastante. Si bien cabe destacar que las actuaciones son bastante mediocres en general. También destacar las canciones a ritmo de jazz, buenísimas.', 0, NULL, NULL, NULL, NULL, NULL),
